INSERT INTO `collections` VALUES (1,'Travel','travel',0,0,'What to do at home? You can set your own Facebook color and stand out among your friends with a unique page design. It will look especially cool if you use the theme of travel. You must admit that almost everyone on our blue planet dreams of visiting beautiful places where I have never been before. These places can be beaches with palm trees and white sand growing there, or snow-capped mountains with impassable paths, flowering fields, dense jungle, etc.\r\nEarthly nature is very diverse and each of its branches is beautiful in its own way. Someone loves forest plantations with bird chirping, but for some, the sound of the surf is sweeter than any music. It was for such connoisseurs of natural delights that the \"Travel\" category was created, containing Facebook wallpapers with thematic photos and videos. Using them, you can remove the standard design of the social network and install your own.\r\nTo make the change in the appearance of your page possible, first install the browser extension “Themes for Facebook”. Then add to it any Facebook themes you like from the travel category. After that, activate the design with the click of a mouse and enjoy the new look of FB!','All journeys start the same way - from the first step!','travel.webp','2020-04-25 19:33:36','2020-04-25 19:33:36'),(2,'Comics','comics',0,0,'Adore comic book superheroes? Hulk, Aquaman, Thor, Superman - your idols? Do you want to see them not only in films, but also on Facebook wallpapers, for example? From now on you have such an opportunity thanks to the browser extension “Themes for Facebook”.\r\nWhat kind of extension is this? Very simple and, at the same time, very useful. With it, you can replace the default design of the social network with any other that is presented in the catalog on the site fb.zone. In particular, you can select the “Comics” category and decorate your page with one or more heroes from Marvel or DC.\r\nAs a true comic book fan, you won’t be able to ignore such an offer. Especially when you consider that replacing the design of a social network is 100% free. For this, no one will take a cent from you. You can change the color of Facebook with one click. How to do it? Add a theme to the extension and activate it with a mouse click. After that, you don’t even need to refresh the browser page, the modification is instant.\r\nSo you found out how to get rid of the preinstalled Facebook theme in favor of superhero images and videos.','Feel like a man with supernatural powers or one of the ancient gods of Scandinavia!','comics.webp','2020-04-25 21:14:29','2020-04-25 21:14:29'),(3,'Love','love',0,0,'Facebook love color - what is it? For example, when the background of your page or any other sections of the social network is paved with hearts, wedding rings, etc. That is, paraphernalia for couples in love. It is beautiful, touching and consistent with the mood of those who are in a romantic relationship or a happy marriage.\r\nThis design can be used not only on Valentine\'s Day. Indeed, real feelings do not activate on February 14, but remain with people all their lives. If you agree with this statement, study the “Love” category and select the Facebook wallpaper to decorate your profile. You can apply them using the extension, which is called \"Themes for Facebook\" and is intended for the Google Chrome browser.\r\nFirst install the above extension. Then return to the selection of topics on the site and click the “Add” button, which appears when you hover over the picture with the mouse. The selected design will be added to the extension, you just have to apply it.\r\nSo you found out where Facebook themes about love and adoration live. Over time, the number of wallpapers will be increased, but for now, use those that are available. Extension and design options are free and accessible to everyone.','Love is never too much','love.webp','2020-04-25 21:17:37','2020-04-25 21:17:37'),(4,'Cats','cats',0,0,'How do they touch, all these fluffy lumps with compassionate eyes, which can be found not only on the street, but also on Facebook wallpapers! If you like cats, you have already guessed that we are talking about them. Of course, they have a very wayward character and sometimes they show it, releasing claws or hissing. But these are such trifles that you don’t want to be angry at all, because a pet is a family favorite. Without it, it becomes boring and lonely, and with it life turns into a holiday.\r\nFor kitty lovers, we have prepared something special. We are talking about a new design of a social network in cat style. You can change the design of the buttons and background of your page, as well as any other sections of the FB that you are accustomed to visiting. Change Facebook color is now possible thanks to the extension “Themes for Facebook”. It is intended for the Google Chrome browser and is completely free.\r\nWhat needs to be done to dress up a social network in a cat form? Install our extension first, then add any of the themes in the Cats category. After that, activate the selected design with one click and enjoy the cat\'s Facebook theme! We are sure that you will like these design solutions. Enjoy your use!','The time spent with the cat has never been wasted','cats.webp','2020-04-25 21:26:32','2020-04-25 21:26:32'),(5,'Flowers','flowers',0,0,'Every girl has a favorite flower. It can be a rose, an orchid, a lily of the valley, a tulip and hundreds of other representatives of the flora. We took into account the preferences of the beautiful half of humanity and developed Facebook themes in floral style. Now you can change the standard background and social network buttons to any of the available colors.\r\nAdore violets or lilacs? Crazy about mimosas or daisies? Install the \"Themes for Facebook\" extension and turn your page into a flowering field! When guests come to you, you can surprise them with the colorful and individual profile. Agree that not every FB profile looks as original as yours.\r\nSo, how to change Facebook color in one action? If you have already added our extension to the browser, you just have to go to the “Flowers” ​​category and click on the “Add” button. Then activate the selected design in the extension itself and refresh the page. When you do this, you will immediately see the changes that have occurred and the change in design.\r\nDo you want to go to your page on a social network every day and enjoy Facebook floral wallpaper? Then you know what to do! Choose any of the topics in the category and start using! It is not only convenient, but also completely free.','Flowers are masterly mood composers','flowers.webp','2020-04-25 21:34:48','2020-04-25 21:34:48'),(6,'Games','games',0,0,'Computer and video games are a favorite way of entertaining young people and more. And such masterpieces as GTA, Far Cry, Call of Duty, Minecraft have millions of fans. Real gamers immerse themselves in the gameplay with their heads and therefore adore everything related to their favorite games. This also includes Facebook themes. After all, now instead of the standard design of the social network, you can install gaming wallpapers.\r\nSuppose you already have gaming peripherals, the same chair, and hardware. But, visiting your page on FB, you return to gray everyday life and boring reality. Do not spoil your mood! Just install the \"Themes for Facebook\" extension for Google Chrome and add one of your Facebook gaming themes to it! So you personalize the design of the questionnaire and raise your morale for the battle with virtual enemies.\r\nThe functionality of the social network after installing new wallpapers does not change. Everything will remain in place. The only thing that changes will affect is the design of buttons, background. They are modified into a gaming style and will change the default color of Facebook to a more original design, made in accordance with the gaming theme. We are sure that you will like this solution very much.','Let\'s see which of you is a true gamer','games.webp','2020-04-25 21:49:10','2020-04-25 21:49:10'),(7,'Space','space',0,0,'Keep track of space news and dream to see a UFO? Crazy about films whose main characters are fighting foreign invaders? If this is true, you should forget about the boring color of Facebook, replacing it with space wallpaper. They can be depicted interstellar shuttles, nebulae, planets, and even aliens themselves.\r\nWhat could be more mysterious than civilizations from other galaxies? What do they look like? Maybe they are kind lizards with 4 eyes and a blue tongue or evil octopus-like creatures with 3 suckers on their hands and tentacles instead of legs? Or are they like us? You can assume as much as you like, but these are just fantasies and conjectures. However, the most successful of them can be embodied in the form of colorful Facebook wallpapers, which we did.\r\nTo change the design of the social network by default, you need to add an extension called “Themes for Facebook” to the browser. When you do this, select any design you like in the style of space and add it to the extension. First, one click on the “Add” button (appears when you hover over the topic with the mouse pointer), then activate the wallpaper and admire the result of the redesign.\r\nWe hope you enjoy Facebook themes about the universe and its mysteries.','Feel like a star pioneer and a talented space explorer!','space.webp','2020-04-26 20:15:26','2020-04-26 20:15:26'),(8,'Abstract','abstract',0,0,'A person with abstract thinking is capable of much. He can easily go beyond the generally accepted truths and discover something new, unique. Facebook abstract themes help such talents by stimulating their brain activity with visual forms. In addition, such a design can be very cute. It looks much better than the standard design of a social network that everyone knows.\nAn abstract picture is the lack of specificity, but at the same time, the coverage of everything at once. What could it be? A whirlwind of flowers and lines, fragments or crystals, a bright mosaic, various substances, geometric shapes and much more. Such an image cannot be characterized to the smallest detail. It is multifaceted and unusual.\nHow to put Facebook wallpaper in the form of abstraction? The first thing to do is install the Themes for Facebook extension. Then add to it those design options that are in this category and have found a response in your heart. After that, you simply activate the selected topic and immediately notice the change in the appearance of the FB.\nWhat elements will the modification affect? First of all, the Facebook color on the buttons will change. Additionally, the background image will be replaced. But keep in mind that these changes are made locally and only you can see them.','Abstraction has the most forms of expression','abstract.webp','2020-04-28 07:43:35','2020-04-28 07:43:35'),(9,'Art & Design','art_and_design',0,0,'How do you feel about contemporary art? And to what was fashionable several centuries ago? With any answer, we have something to offer you. We are talking about the wallpaper for Facebook, copying the paintings of the great artists of antiquity and modernity. Not spared and contemporary designers, whose creative ideas seemed worthy.\nDo you like Picasso paintings or do you prefer Rembrandt? Perhaps you prefer the works of Nikas Safronov? We have nothing against it, because these artists are really talented and their work can cost millions of dollars. But there are also unpopular representatives of design art who are few who know. However, their digital illustrations cause a storm of delight among connoisseurs of art.\nSo, you have a great desire to change the default Facebook color for something like that. To do this, you will first need to install the browser extension “Themes for Facebook” and then add the themes you like to it. Then with one click activate one of them and watch the transformation of your page.\nDoes the functionality of the social network somehow change? No, the extension only modifies the appearance of the buttons and replaces the background with themed Facebook wallpapers. Everything else remains intact, including the location and functionality of the interface elements.','Add inspiration to everyday tasks','art_and_design.webp','2020-05-01 20:38:33','2020-05-01 20:38:33'),(10,'Cars & Motorcycles','cars_and_motorcycles',0,0,'Sports cars, racing bikes - what could be more attractive? Especially if such a \"miracle\" is in your garage or, at least, on Facebook wallpapers. It is clear that not everyone can afford to purchase an expensive vehicle. However, to install a photograph of a first-class motorcycle or a car accelerating to 350 km instead of a blue-gray social network background, anyone can do it for free.\nWhat needs to be done to replace the standard FB design with an image of a limited sports car or bike? The first thing to do is install the Themes for Facebook extension for your browser. Then find the “Cars & Motorcycles” category (you’ve already done this) and select Facebook color themes to your taste. When you decide, click on the “Add” button, thereby adding a theme to the extension. After that, you just have to activate the selected design.\nFollow the dream and, if it seems impossible to you yet, try to realize it at least in the virtual world of a social network! Change the color of Facebook to images of cars or motorbikes you desire and feel like Schumacher or an Arab sheikh with a huge collection of cars and bikes!','Buckle up! We will go very fast','cars_and_motorcycles.webp','2020-05-01 21:14:31','2020-05-01 21:14:31'),(11,'Celebrities','celebrities',0,0,'Who are celebrities? These are famous people who became famous thanks to modern cinema, theatrical productions or musical performances. That is, actors, singers, musicians and other representatives of the artistic genre. In honor of them, Facebook themes were created to replace the standard social network background with a thematic one.\nWho are you really excited about? Jason Statham, Milla Jovovich, Tom Hanks, Dwayne Johnson, Billy Elish, Eminem? Any of these celebrities can appear on your FB page as colorful pictures or even live wallpapers! All you need to do is install the Themes for Facebook extension and add themes from the Celebrities category there, and then apply one of the added design options.\nWho to put on Facebook wallpapers to make it look as cool as possible in the eyes of your friends and acquaintances? First of all, do not try to please anyone. Install the one who impresses you the most as an actor, singer or musician. Whose work you like best and who you would like to be like in your dreams. This will daily raise your spirits and motivate you to maximize your life.\nThe extension and all Facebook wallpapers are currently free. You can download, install and use them to your pleasure.','Idols of millions of people are now on your Facebook page','celebrities.webp','2020-05-01 21:26:10','2020-05-01 21:26:10'),(12,'Nature','nature',0,0,'How to relax and relieve stress? You can lie down to relax, watch a movie or admire Facebook wallpapers on a natural theme. If landscapes alone are not enough, turn on the sounds of the surf, the twittering of birds or the murmur of a stream. Together with vivid photographs of the ocean, forest, mountains or a river, this will be the best relaxation for those who are tired.\nNature is the most beautiful and natural on Earth. Remember what places you visited and which you would like to visit in the future? Maybe this is the snow-capped peak of Elbrus, the lavender fields of Provence, palm groves Preveli or the beaches of Miami? Be that as it may, the wait for the trip can be delayed, and you can enjoy the scenery right now. All that is needed for this is to change Facebook themes. They are in the category \"Nature\" and are available for free use by everyone.\nTo replace the default design of a social network with a different one, you must first install the Themes for Facebook extension. Once this is done, you need to add those wallpapers that you like visually. Then you simply activate the new Facebook color in place of what it was before. You will see the changes immediately. They concern only the external appearance of the buttons and the background of the social network. Functionality will not be affected.','Just enjoy the beauty that surrounds us','nature.webp','2020-05-01 21:34:32','2020-05-01 21:34:32'),(13,'Holidays','holidays',0,0,'What holidays can you imagine your life without? Thanksgiving, Christmas, Halloween or your own birthday? We believe that there are many answers. Especially for fans to sit at a table in the family circle, Facebook themes with relevant content were developed. You can install them literally in 1 click.\nWhat is needed for this? First of all, add an extension called “Themes for Facebook” to your browser. Then go to the fb.zone website in the “Holidays” category and use the “Add” button under the design option that you like. This action will add the selected theme to the extension and you just have to apply it.\nThe Facebook color that stands in the role of default is tasteless and has bothered many. Therefore, exchange it for something completely different than a breath of fresh air. Moreover, it is absolutely free and does not require knowledge of programming languages, or knowledge of Photoshop. Specialists have already worked for you and created the final product.\nCheck out festive-themed Facebook wallpapers. We are sure that you will find there a suitable design for any significant event in your life.','A simple rule for a happy person is not to miss the holidays','holidays.webp','2020-05-01 21:50:09','2020-05-01 21:50:09'),(14,'Black','black',0,0,'What color is considered the most stylish? Of course, black. Classic fashion is a white top, a black bottom. The standard 