ents of fantasy like floating islands, glittering waterfalls, and more. The fantasy sakura garden can be a place of tranquility and peacefulness, but also a place of wonder and awe, inspiring visitors to let their imagination run wild.',41,0,'{\"header_color\":\"#38343e\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#280d2980\",\"lm_text_color\":\"#f7fdf6\",\"lm_hover_color\":\"#0c3439\",\"lm_hover_text_color\":\"\",\"font_name\":\"Averia Sans Libre\",\"top_bg\":\"#200624\",\"top_text\":\"#d2d9da\"}','fantasy/themes/818-fantasy_sakura_garden_bg.webp','','fantasy/themes/818-fantasy_sakura_garden.webp','fantasy/themes/818-fantasy_sakura_garden_screenshot.webp',725,'[0,0,0,1,1]',4.5,'2024-09-19 03:05:07','2023-01-25 15:20:21','2024-09-18 23:05:07'),(22,'Green blue violet gradient','A green, blue, and violet gradient refers to a color transition that blends together different shades of green, blue, and violet. The gradient can be created by blending the colors together in a linear or radial pattern, creating a smooth transition between the colors. This gradient can be used in various forms of art and design, such as graphic design, web design, and digital art. The combination of colors can evoke different emotions and feelings, the green can symbolize growth, balance and harmony, the blue can symbolize trust, loyalty and wisdom, and the violet can symbolize creativity, spirituality and luxury. These colors together can create a sense of balance and harmony, making the artwork or design look more attractive and easy on the eye. The gradient can be used in backgrounds, logos, illustrations, and more. It\'s a very versatile way of adding color to a design and can be used in Facebook page custom design.',8,0,'{\"header_color\":\"#e8dad5\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text