tyle is often used as a background visual for videos on social media platforms like Facebook. These backgrounds can be created using a variety of techniques, such as digital or traditional art, animation, and 3D modeling. They can be used to add visual interest and dynamic movement to a video and to convey a certain mood or theme. Abstract geometry backgrounds can be created using different software such as Adobe After Effects, Cinema 4D, and Blender, among others. Some creators also use generative art tools to create unique and dynamic patterns automatically.',8,0,'{\"header_color\":\"#bfd5ed\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#edecf080\",\"lm_text_color\":\"#18241e\",\"lm_hover_color\":\"#e3c8d8\",\"lm_hover_text_color\":\"\",\"font_name\":\"Electrolize\",\"top_bg\":\"#e0cef3\",\"top_text\":\"#373b28\"}','abstract/themes/134-geometry_bg.webp','','abstract/themes/134-geometry.webp','abstract/themes/134-geometry_screenshot.webp',435,'[0,0,0,1,0]',4,'2024-09-14 23:13:35','2023-01-27 17:45:44','2024-09-14 19:13:35'),(34,'Sci Fi space','Visual style that features imagery and elements related to science fiction and space, such as spaceships, planets, galaxies, and other celestial bodies. This style is often used as a background visual for videos on social media platforms like Facebook. These backgrounds can be created using a variety of techniques, such as digital or traditional art, animation, and 3D modeling. They can be used to add visual interest and dynamic movement to a video and to convey a certain mood or theme. Sci-Fi space backgrounds are often used in film and television to create a sense of otherworldliness and to convey a futuristic or technologically advanced setting.',7,0,'{\"header_color\":\"#170729\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#1e143780\",\"lm_text_color\":\"#cec6ce\",\"lm_hover_color\":\"#023c0e\",\"lm_hover_text_color\":\"\",\"font_name\":\"Nunito Sans\",\"top_bg\":\"#11100d\",\"top_text\":\"#becdf9\"}','space/themes/669-sci_fi_space_bg.webp','','space/themes/669-sci_fi_space.webp','space/themes/669-sci_fi_space_screenshot.webp',659,'[0,0,0,0,0]',0,'2024-09-19 01:25:28','2023-01-27 17:49:52','2024-09-18 21:25:28'),(35,'Blockchain network','The network of computers that maintain a blockchain is called a \"node.\" Each node has a copy of the ledger and helps to verify new transactions by solving complex mathematical problems. Once a block of transactions is verified, it is added to the chain and becomes a permanent part of the ledger.\r\n\r\nOne of the key features of a blockchain is that it is immutable, meaning that once a transaction is recorded in a block, it cannot be altered or deleted. This makes it a secure and transparent way to store and transfer digital assets.\r\n\r\nBlockchains are the technology behind cryptocurrencies like Bitcoin, but they can also be used for a wide range of other applications, such as supply chain management, voting systems, and digital identity.',23,1,'{\"header_color\":\"#e9fbe4\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#bfe2f880\",\"lm_text_color\":\"#281409\",\"lm_hover_color\":\"#fdc1eb\",\"lm_hover_text_color\":\"\",\"font_name\":\"BioRhyme\",\"top_bg\":\"#323336\",\"top_text\":\"#f8e6de\"}','3d_graphics/themes/626-blockchain_network_bg.mp4','3d_graphics/themes/626-blockchain_network_bg_thumb.webm','3d_graphics/themes/626-blockchain_network.webp','3d_graphics/themes/626-blockchain_network_screenshot.webp',589,'[0,0,0,0,2]',5,'2024-09-14 06:35:37','2023-01-27 18:03:19','2024-09-14 02:35:37'),(36,'Sea bay','A sea bay is a type of coastal feature that is formed by the erosion of land by waves and currents. A bay is typically a smaller body of water that is partially enclosed by land, with an opening to the sea. Sea bays are often found along coastlines that are characterized by rocky cliffs, sandy beaches, and headlands.\r\n\r\nSea bays are often popular tourist destinations due to their scenic beauty and recreational opportunities. They can offer swimming, boating, fishing, and other water activities. They also provide important habitat for a variety of marine life, including fish, birds, and other animals.',1,0,'{\"header_color\":\"#c4d6e3\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#fbfbf680\",\"lm_text_color\":\"#20042d\",\"lm_hover_color\":\"#c1dee8\",\"lm_hover_text_color\":\"\",\"font_name\":\"Kiwi Maru\",\"top_bg\":\"#bbb9b4\",\"top_text\":\"#5b5770\"}','travel/themes/732-sea_bay_bg.webp','','travel/themes/732-sea_bay.webp','travel/themes/732-sea_bay_screenshot.webp',235,'[0,0,0,0,0]',0,'2024-09-15 00:30:09','2023-01-27 18:08:02','2024-09-14 20:30:09'),(37,'Fortnite location','Fortnite is a popular online video game that is set on a fictional island. The island is the main location where players engage in battle royale-style gameplay, where 100 players parachute onto the island and fight to be the last one standing.\r\n\r\nThe island is divided into different regions, each with its own distinct geographical features and landmarks. These regions include the snow-covered mountains of Frosty Fjords, the dense forests of Misty Meadows, the sandy beaches of Sweaty Sands and the industrial areas of Rickety Rig.\r\n\r\nThe island is also dotted with various landmarks and buildings that players can use for cover and to find weapons and other items. These include houses, gas stations, supermarkets, and other structures. The island also features a volcano, a castle, and a lighthouse.',6,0,'{\"header_color\":\"#242432\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#17090d80\",\"lm_text_color\":\"#d5d6d2\",\"lm_hover_color\":\"#1e0f13\",\"lm_hover_text_color\":\"\",\"font_name\":\"Laila\",\"top_bg\":\"#c7d2fa\",\"top_text\":\"#3e1b20\"}','games/themes/969-fortnite_location_bg.webp','','games/themes/969-fortnite_location.webp','games/themes/969-fortnite_location_screenshot.webp',250,'[0,0,0,0,0]',0,'2024-09-10 17:30:05','2023-01-27 18:12:32','2024-09-10 17:30:05'),(38,'Galaxy spiral','Galaxy that has a spiral shape, with a central bulge and arms that spiral outwards. These arms are made up of stars, gas, and dust and are where new stars are formed. The Milky Way, our own galaxy, is an example of a spiral galaxy. The spiral shape is created by the rotation of the galaxy and the gravitational pull of the central bulge. These forces cause the gas and dust in the arms to compress, leading to the formation of new stars. The bright central bulge of a spiral galaxy is usually composed of older stars, while the arms contain younger, more luminous stars. The spiral structure of a galaxy is thought to be maintained by the rotation of the galaxy and by the gravitational pull of dark matter, a mysterious substance that makes up most of the mass in the universe.',7,1,'{\"header_color\":\"#100904\",\"header_color_text\":\"\",\"themes_color\":\"\",\"headlight_link_color\":\"\",\"text_color\":\"\",\"comments_color\":\"\",\"notifications_color\":\"\",\"input_color\":\"\",\"lm_background_color\":\"#2f2a2b80\",\"lm_text_color\":\"#f8f3f5\",\"lm_hover_color\":\"#1d3a28\",\"lm_hover_text_color\":\"\",\"font_name\":\"Nunito\",\"top_bg\":\"#05162c\",\"top_text\":\"#cfe1cf\"}','space/themes/134-galaxy_spiral_bg.mp4','space/themes/134-