INSERT INTO `skins` VALUES (1,'Little cute unicorn','cute_unicorn_youtube_skin','Meet this funny character who really wants to be friends with you. For this, he settled in the player and now this little cute unicorn YouTube skin will delight you every day and create a good rainbow mood for you. You already know that unicorns are fabulous creatures, maybe he will fulfill your most cherished desires? Tell him hello!','{\"playbar_background\":\"\",\"ytpswatchbackgroundcolor\":\"background: linear-gradient(180deg, rgba(255,198,95,1) 0%, rgba(255,198,95,1) 33%, rgba(253,108,203,1) 33%, rgba(253,108,203,1) 66%, rgba(57,212,255,1) 67%, rgba(57,212,255,1) 100%);\",\"ytpprogresslist\":\"height: 13px; bottom: 8px; background: #ffffff80;\",\"ytpscrubberbutton\":\"background-position: -161px -16px; background-size: 210px; height: 34px !important; width: 35px !important;                         \",\"ytpscrubbercontainer\":\"top: -17px !important; left: -6.5px; z-index: 43;                         \",\"ytpvolumesliderhandlebefore\":\"left: -57px; background: #F83E6F;\",\"ytpvolumesliderhandleafter\":\"left: 9px; background: #ffffff;\",\"ytpvolumesliderhandle\":\"width: 17px !important; height: 17px !important; border-radius: 6px !important; margin-top: -9px !important;                         \",\"ytpbuttonariapressedafter\":\"backgroung: #F83E6F;\",\"ytpgradientbottom\":\"height: 195px !important;                       \",\"ytptimedisplaysilver\":\"color: #3A0172; fill:#3A0172;                         \",\"ytptimedisplayred\":\"color:red;                         \",\"leftbottom\":\"width: 100px; height: 100px; position: absolute; bottom: 0; left: 0; pointer-events: none; z-index: 24; background-size: contain;                                                 \",\"lefttop\":\"width: 100px; height: 100px; position: absolute; top:0; left: 0; pointer-events: none; z-index: 24; background-size: contain;                         \",\"rightbottom\":\"width: 100px; height: 100px; position: