ion are a mix of standard shapes and sizes with a bright, unusual look. This is an excellent choice for those who prefer the usual forms, but want to bring diversity, originality and brightness to everyday life. The collection has a hand cursor and a familiar arrow in a variety of variations - from the Google Chrome logo to emoticons, you can even meet here a long-forgotten dragon with cacti and nostalgia. We prove that a standard cursor can also be interesting and attractive. Different colors, shapes, textures and interesting design will help you choose the cursor to your taste or change it every day depending on the mood or tasks performed. Changing browser cursors is very simple - just install the extension and download the collection to your device. Funny, interesting cursors will not only color the working days, but also, for example, help to make any presentation more interesting, and with the help of especially bright cursors, also draw attention to individual elements of the report.','A new look at familiar things: an updated series of cursors','62693af8723bd.png','pic_62693af884992.png','2022-04-27 12:45:44','2022-04-27 12:45:44'),(10,'Ratchet & Clank','ratchet_and_clank',0,0,'Cursors from the starter collection are a mix of standard shapes and sizes with a bright, unusual look. This is an excellent choice for those who prefer the usual forms, but want to bring diversity, originality and brightness to everyday life. The collection has a hand cursor and a familiar arrow in a variety of variations - from the Google Chrome logo to emoticons, you can even meet here a long-forgotten dragon with cacti and nostalgia. We prove that a standard cursor can also be interesting and attractive. Different colors, shapes, textures and interesting design will help you choose the cursor to your taste or change it every day depending on the mood or tasks performed. Changing browser cursors is very simple - just install the extension and download the collection to your device. Funny, interesting cursors will not only color the working days, but also, for example, help to make any presentation more interesting, and with the help of especially bright cursors, also draw attention to individual elements of the report.','A new look at familiar things: an updated series of cursors','62693b3f71ba0.png','pic_62693b3f81838.png','2022-04-27 12:46:55','2022-04-27 12:46:55'),(11,'Frozen','frozen',0,0,'When an ancient prophecy comes true and the kingdom plunges into the embrace of winter, three fearless heroes - Princess Anna, brave Kristoff and his faithful reindeer Sven - go to the mountains to find Anna\'s sister, Elsa, who can remove the chilling spell from the country. Along the way, many difficult surprises and exciting adventures await them. Meeting mystical trolls, meeting a charming snowman named Olaf, mountain peaks steeper than Everest and a lot of magic. Heroes have to resist the mighty elements in order to save the kingdom and those who are dear to them.','Breaking the ice is easy with the collection of Frozen cursors','6287548d35833.png','pic_6287548d46810.png','2022-05-20 08:42:53','2022-05-20 08:42:53'),(12,'Harry Potter','harry_potter',0,0,'Harry James Potter is the protagonist of a series of novels by English writer JK Rowling. On his eleventh birthday, Harry learns that he is a wizard and is destined for a place at the Hogwarts School of Wizardry, where he will practice magic under the guidance of headmaster Albus Dumbledore and other school professors. Harry also discovers that he is already known throughout the magical community of the novel, and that his fate is connected with the fate of Voldemort, a dangerous dark magician.','What will you do with a magic wand from the collection of Harry Potter cursors','62876d6fa27b1.png','pic_62876d6fb222b.png','2022-05-20 10:29:03','2022-05-20 10:29:03'),(13,'TUNIC','tunic',0,0,'Legends say that a huge treasure is hidden somewhere in this land. Maybe it\'s behind the golden door? Or somewhere deep underground? Some legends speak of a palace high above the clouds and of ancient beings with incredible powers. What will you find along the way? During your travels, you will recreate the Game Instructions. Join the battle and master a variety of techniques. Dodge, block, parry and attack! Learn how to defeat monsters big and small and find useful new items to help along the way.','Explore a land with legends in the form of Tunic cursors','62876f6b9ad3d.png','pic_62876f6ba8d0c.png','2022-05-20 10:37:31','2022-05-20 10:37:31'),(14,'L.O.L. Surprise','lol_surprise',0,0,'LOL Surprise dolls fell in love with children and won their hearts from the first minutes. And this is not surprising, because such success is based on a mystery, the expectation of a miracle, a pleasant surprise, which delights not only kids, but also their parents. The secret of the gift is revealed to the child only after the final unpacking. In any case, LOL dolls are an attractive design, intrigue, a large number of amazing and realistic accessories and pleasant little things, as well as the highest quality of production and detailing of the toy.','Cool cuties for connoisseurs of beautiful surprises','628770b8f1d9b.png','pic_628770b90ee79.png','2022-05-20 10:43:05','2022-05-20 10:43:05'),(15,'HALO','halo',0,0,'Halo is a combat fantasy media franchise created by Bungie. Based on the original trilogy of first-person shooter video games. The plot revolves around the events taking place in the life of Master Chief, one of a group of super-soldiers codenamed \"Spartans\", and his companion, the artificial intelligence Cortana. The success of the games has led to the expansion of the franchise into other media: the Halo universe currently spans many books, graphic novels, comics, shorts, animations, and feature films.','Touch the artifact cursor, maybe you are the chosen one','6287722a7e202.png','pic_6287722a8ede5.png','2022-05-20 10:49:14','2022-05-20 10:49:14'),(16,'Hello Kitty','hello_kitty',0,0,'Hello Kitty is a Japanese character that is famous all over the world and has become a cultural phenomenon. This is a popular image, which is a white cat with a large head, small ears and eyes, no mouth and a red bow on her head. In our collection of Hello Kitty cursors you will meet your favorite characters from the series. An interesting fact is that the lack of a mouth also symbolizes that the character speaks from the heart and this facilitates communication between representatives of different cultures.','Everyone loves kittens, especially if it\'s Hello Kitty.','637d347268124.png','637d34726817b.png','2022-11-22 20:43:30','2022-11-22 20:43:30'),(17,'Minecraft','minecraft',0,0,'Minecraft is a building sandbox where you are free to go about your business whenever you want. A life simulator in which you play a huge role as a world builder! Your success will depend only on your imagination, and a little bit on the directness, again, of your hands. We will have to build our, in fact, real, from a variety of materials that have only one similarity - a form in the form of a block. It remains only to add Minecraft cursors to give free rein to our fantasies.','You can build anything with Minecraft cursors','637e11ad9b5c7.png','637e11ad9b60d.png','2022-11-23 12:27:25','2022-11-23 12:27:25'),(18,'Naruto Anime','naruto_anime',0,0,'The Naruto anime series is a Japanese comic, the so-called manga, which tells about the Japanese state in which there are hidden villages where ninjas live. The protagonist of the series is a restless teenage ninja Naruto Uzumaki, who dreams of becoming the head of his village, a respected and powerful ninja. The collection of Naruto cursors is dedicated to the characters of the popular anime.','You can\'t do without Naruto cursors if you want to become a real ninja','637e1dc92a46d.png','637e1dc92a4b2.png','2022-11-23 13:19:05','2022-11-23 13:19:05'),(19,'Pokemon Anime','pokemon_anime',0,0,'Pokemon serial anime, which is very popular around the world. This is a story about Ash, whose cherished dream is to become a Pokémon Master, that is, one of the strongest trainers of all time. By an absurd accident, Pikachu turned out to be his first ward, and together with his partner he goes on a long journey. Their adventures are not the easiest: the organization of villains \"Team Rocket\", consisting of Jesse, James and Meowth, every time tries to undermine the plans of the guys, which adds even more difficulties during the road. We hope Pokemon cursors will please true fans!','Pokemon training will be fun with Pokemon anime cursors','637e22061e0ea.png','637e22061e130.png','2022-11-23 13:37:10','2022-11-23 13:37:10'),(20,'Rainbow Friends','rainbow_friends',0,0,'Rainbow Friends is a trending Roblox Horror game developed by Fragment Games in which the hero has to stand against 4 different monsters in rainbow colors. Each of these monsters has its own characteristics and skills. In the collection of Rainbow Friends cursors you will find each of them as well as some morphs. The essence of the game is to pass levels independently or collectively, the main goal in this case is to get out of the location filled with unusual monsters - Rainbow Friends. In order to avoid collision with these creatures, the player needs to choose rational ways of movement, hide in boxes and not yawn at the moment when you need to run.','Hurry up and choose the Rainbow Friends cursor, the game starts now','637e29011b871.png','637e29011b8b8.png','2022-11-23 14:06:57','2022-11-23 14:06:57');
