INSERT INTO `categories` VALUES (1,'Комиксы','Comics','Historietas','komiksy',0,0,'Казалось бы, курсор мыши – это мелочь, но зачастую именно такие детали могут улучшить настроение, разбудить серым утром или просто подарить яркие эмоции. Коллекция курсоров по комиксам разработана специально для всех любителей супергероев.\r\nЗдесь можно найти абсолютно всех Вселенной Марвел и ДС Комикс – от Железного человека до Таноса, Человека-паука и Халка. Картинка курсора может быть как в форме самого супергероя, так и в виде его знака.\r\nКурсор – это не просто функциональный элемент, он важен в профессиональном смысле. Например, если записывать видео с экрана, лучше видно будет яркую, оригинальную картинку, и выглядит это куда более интересно. Ну и конечно – кому бы, не хотелось воспользоваться перчаткой бесконечности в реальной жизни?\r\nИзменить курсор мыши просто – достаточно скачать расширение на свой браузер и через него добавить понравившиеся значки в свои параметры настройки. Можно выбирать курсор по настроению хоть каждый день. Долой серые будни – становись супергероем прямо сейчас!','Курсоры по комиксам: выбери свое настроение сегодня.','5d616add55f03.png','2019-08-24 13:50:37','2022-10-26 03:43:23'),(2,'Игры','Games','Juegos','igry',1,0,'Компьютерные игры уже давно стали неотъемлемой частью нашей жизни. С их помощью можно погрузиться в новый мир, поучаствовать в приключениях и стать совершенно другим человеком. У каждого есть своя любимая игрушка, герои которой уже стали почти родными.\r\nНабор курсоров по мотивам известных компьютерных игр – это возможность разбавить скучные будни и внести в рабочий процесс немного креативности, яркости и веселья. Только представьте, как скучный доклад вычитывает и правит Марио, а Пакман пытается написать эссе на тему «Современные тенденции политической системы». Поверьте, эти занятия сразу перестанут быть такими нудными, а время пролетит незаметно.\r\nВ наборе представлены как изображения самих героев игр, так и вспомогательные персонажи, оружие и значки игр. Выбирайте то, что подходит под Ваше настроение – игровые курсоры понравятся не только игроманам, но и всем, кому просто надоели серые будни. Просто скачиваем набор, изменяем курсор мыши – и вперед, на выполнение квестовых задач, уничтожение противников и достижение поставленных целей.','Виртуальная реальность: а кем играешь сегодня ты?','5d6181cf9b40a.png','2019-08-24 15:28:31','2022-10-26 03:43:23'),(3,'Мультфильмы','Cartoons','Dibujos animados','multfilmy',0,0,'В каждом взрослом еще живет ребенок, который обожает мультфильмы, и до сих пор мечтает стать одним из героев. Мы поможем воплотить Ваши мечты в жизнь – используйте новую коллекцию курсоров по мотивам самых известных и любимых мультфильмов. Том и Джерри, Базз Лайтер и Шрек, Gravity Falls и даже Покемоны – Вы можете становиться кем хотите каждый день.\r\nПодбирайте курсор мышки под свое настроение. Кто Вы сегодня? Бесшабашный и веселый миньон, который легко решает любые проблемы или сильный и смелый Рафаэль, цель которого не только совершить подвиги, но еще и подкрепиться пиццей? Может быть Вы всемогущий джинн, который держит в подчинении целый офис? В коллекции найдутся герои для всех – от принцесс до драконов – остается только решить, кто отражает сегодняшнее настроение.\r\nСтиль курсора – это не просто яркая картинка. Это отражение индивидуальности, проявление себя и попросту – веселье, радость и позитив на весь день. Скучно работать или лень учиться? Стало грустно и ничего не радует? Смените курсор – и мир заиграет новыми красками. ','Любимые мультяшные герои в новом оформлении\r\n','5d62e244871c2.png','2019-08-25 16:32:20','2022-10-26 03:43:23'),(4,'Кино и сериалы','Movies','Películas','kino_i_serialy',0,0,'Фильмы – это волшебство, мистика и просто прекрасный способ отдохнуть, провести весело время и получить яркие эмоции. При этом после просмотра у нас остаются в памяти любимые герои, с которыми так хочется встретиться в реальности.\r\nТеперь это возможно – достаточно скачать новую коллекцию курсоров по мотивам известных фильмов и ТВ-передач. Яркие, крутые курсоры станут прекрасным дополнением рабочего стола, превратят скучные серые будни в праздник, а банальные задачи – в увлекательное приключение.\r\nМеняйте героя курсора каждый день – под настроение, задачи или рандомно. Кем Вы станете сегодня? Честным и справедливым Джоном Сноу или смелым, неотступным Джоном Уиком? Может быть, Вам предстоит сложная миссия и пройти ее сможет лишь Фродо? Может Вы сегодня просто инопланетянин, который не хочет выходить на контакт с окружающими? Выбирайте подходящий курсор – поднимите себе настроение и заодно покажите окружающим, о чем думаете и как рассчитываете провести свой день. \r\nПопробуйте – это не только весело, но и затягивает – возвращаться к обычной стрелке Вы точно больше не захотите. ','Властелин курсора: братство рабочего стола','5d62e28158f42.png','2019-08-25 16:33:21','2022-10-26 03:43:24'),(5,'Аниме','Anime','Anime','anime',0,0,'Аниме – это уникальный и неповторимый стиль анимации, который несмотря на выраженную этническую принадлежность, пришелся по вкусу миллионам людей во всем мире. Вряд ли найдется хоть один человек, который не смотрел мультфильмы в этом стиле. Мы создали самые крутые курсоры в стиле Аниме, которые понравятся всем фанатам этого стиля.\r\nСтандартные курсоры – это скучно и банально. Прояви свою индивидуальность – используй коллекцию курсоров Аниме с любимыми героями. Выбери курсор темного меча, если мечтаешь о приключениях и отважных сражениях. Милый толстячок Тоторо поднимет настроение даже в самый грустный день, а Наруто мотивирует на приключения и покажет всем окружающим, что ты – мегакрут.\r\nЯркие курсоры скрасят рабочий день или сделают процесс обучения более интересным и приятным. Не ограничивай себя – используй самые любимые мотивы даже в таких небольших элементах, как курсор мыши. Меняй курсоры каждый день, подстраивай их под настроение и проявляй свою индивидуальность – с курсорами в стиле Аниме это так просто.','Все любят аниме: а кто Ваш любимый герой?','5d62e2b35efe9.png','2019-08-25 16:34:11','2022-10-26 03:43:24'),(6,'Футбол','Football','Fútbol','futbol',0,0,'Футбол – это особый вид спорта, который включает в себя элементы борьбы, атлетики, меткости. В общем он зрелищный, беспощадный и собирает миллионы фанатов по всему миру. Ты любишь футбол или просто обожаешь спорт? Тогда скачивай себе набор курсоров в стиле всемирно известной игры и докажи звание преданного фаната.\r\nВ коллекции представлено 24 варианта оформления курсоров – в виде самых популярных команд, которые заслужили свои звания отчаянной и стойкой игрой. Курсоры выполнены в двух вариантах – в виде стандартного треугольника, оформленного в расцветку команды, или в виде соответствующего игрового шлема.\r\nСтандартный курсор браузера – это скучно и не достойно настоящего фаната спорта. Становись оригинальным и неповторимым с нашей коллекцией. Скачивай изображения и выбирай цвета любимой команды или кастомные курсоры, если просто любишь спорт и болеешь за всех. Следовать своим увлечениям так просто – необязательно являться на работу в шарфе или кепке любимой команды, достаточно быстро и легко поменять курсор на яркое, стильное изображение. ','Ты реальный фанат спорта? Тогда тебе сюда','5d62e2d98129a.png','2019-08-25 16:34:49','2022-10-26 03:43:24'),(7,'Автомобили','Cars','Coches','avtomobili',0,0,'Любите автомобили и с удовольствием смотрите на модели разных производителей? Или давно мечтаете о конкретной марке, но приобрести ее пока не имеете возможности? Специально для Вас мы создали яркий набор курсоров «Суперкары».\r\nЗдесь Вы найдете классический Форд и стильный Бентли, яркий Ламборджини и неповторимый Феррари. Хотите стать владельцем оригинального автомобиля? Всё просто – скачивайте на свое устройство нашу коллекцию курсоров и меняйте изображение автомобиля хоть каждый день.\r\nКурсоры оформлены в двух вариантах – как полноценный автомобиль или в качестве его знака. Выбирайте то, что Вам больше нравится или то, как Вам удобнее работать. Такие изображения отлично будут смотреться в качестве игровых курсоров или просто как необычный элемент рабочего стола.\r\nБыть ярким просто – необязательно для этого делать невообразимые вещи или менять свою внешность. Достаточно просто перестать пользоваться банальными предметами и выбирать то, что действительно тебе нравится. Коллекция курсоров «Автомобили» – выбор для тех, кто не боится проявлять себя. ','Машина твоей мечты: большой автопарк для профессионалов','5d62e2ef45b13.png','2019-08-25 16:35:11','2022-10-26 03:43:24'),(8,'Мемы','Memes','Memes','memy',0,0,'Мемы давно стали привычной частью нашей жизни. Да и кто из нас не любит эти емкие, интересные и оригинальные изображения на злобу дня? Многие герои мемов стали не просто популярными – они приобрели статус народных любимцев, а фразы и выражения давно вошли в разговорную речь в качестве устоявшихся оборотов.\r\nМы представляем коллекцию лучших курсоров, оформленных по мотивам самых популярных мемов. С их помощью можно не только проявить свою индивидуальность, но также выразить свое настроение. Вас все достали и все надоело? Выбирайте сердитого кота, который всем своим видом выражает негодование и неприязнь ко всему окружающему. Или Вы сегодня блещете сарказмом и не прочь посмеяться? Тогда Drake Bling станет отличным сопровождением – он поднимет настроение и сделает любую задачу оригинальной и интересной.\r\nУстановите расширение, скачайте нашу коллекцию – и выбирайте стиль курсора на каждый день. Быть ярким и оригинальным не сложно – смени стандартное оформление значка на одного из героев мемов и получи заряд бодрости на весь день. ','Любимые мотивы: коллекция курсоров «Мемы»','5d62e30c5fddd.png','2019-08-25 16:35:40','2022-10-26 03:43:24'),(9,'Эмоджи','Emoji','Emoji','emodji',0,0,'Эмоджи – яркие, прикольные значки, без которых мы уже не сможем привычно общаться. С их помощью не нужно описывать словами свое настроение – достаточно выбрать нужный значок и собеседник понял тебя без лишних слов.\r\nВ нашем новом наборе курсоров мы воплотили идею эмоджи – так и появились забавные и необычные Курсоджи, которые раскрасят мир и сделают жизнь более интересной. С помощью курсоджей можно не только работать и выполнять привычные задачи, но также показывать коллегам, друзьям и просто окружающим свое настроение.\r\nСонный курсор отлично подойдет для утра понедельника, а плач курсора выразит отношение по поводу дополнительных обязанностей. Крутой курсор в очках – лучший выбор перед отпуском, а курсор с баксами в глазах – прекрасный повод намекнуть руководителю о повышении заработной платы.\r\nИспользовать курсоджи весело и интересно – будь то работа, учеба или презентация. В последнем случае даже рекомендуется сделать это, если у коллег есть чувство юмора или просто нужно разрядить ситуацию. В общем для любых задач – просто выбирайте нужный курсодж! ','Покажи свое настроение окружающим – установи Курсоджи!','5d62e32cd9c48.png','2019-08-25 16:36:12','2022-10-26 03:43:24'),(10,'Питомцы','Pets','Mascotas','pitomcy',0,0,'Вы любите животных? Наверняка – они же такие милые, забавные и очень веселые. Почему бы не проводить весь день в сопровождении лучших друзей человека? Скачивайте себе коллекцию курсоров «Питомцы» и выбирайте себе друга на каждый день.\r\nЗначок курсора может быть милым, как добродушная альпака, или стильным, как розовый фламинго. А может быть, Вы будете весь день заняты и выберите единорога, читающего газету, или просто не хотите ни с кем общаться, как злобный черный кот? На любое настроение у нас есть соответствующее животное. Веселый мопс поднимет настроение даже в самый скучный и серый день, а розовый курсор в виде единорога покажет всем, что Вы не лишены чувства прекрасного, даже будучи брутальным бородачом.\r\nЧто делать, если нет настроения, а выполнять рутинные задачи совсем не хочется? Рецепт простой – скачиваем коллекцию «Питомцы», изменяем курсор мыши – и вуаля, вокруг снова светит солнце, погода прекрасна, а настроение на самой высокой отметке. Не зря говорят, что животные помогают бороться с депрессией и грустью! ','Яркие курсоры для всех любителей братьев наших меньших','5d62e347ed190.png','2019-08-25 16:36:39','2022-10-26 03:43:24'),(11,'Стиль и красота','Fashion and style','Moda y estilo','stil_i_krasota',0,0,'В новой коллекции курсоров мы собрали самые разнообразные предметы, которые вызывают у нас приятные эмоции и поднимают настроение. Этот набор курсоров назван «Стиль и красота», поскольку именно любимые вещи определяют наши повседневные будни, дарят радость и мотивируют на совершение важных дел, пробуждают стремления к совершенствованию.\r\nВы увлекаетесь космосом и мечтаете отправиться на другие планеты? Выбирайте курсор НАСА или тарелку инопланетян – станьте ближе к своей мечте. Если Вы не представляете себе жизнь без музыки или являетесь завзятым рокером, тогда курсор в стиле электрогитары – точно для Вас. Специально для инженеров разработан курсор кисть, линейка и циркуль – такие изображения помогут превратить скучные расчеты и чертежи в оригинальные решения.\r\nВолшебная палочка и кроссовки, скейтборд и помада, солнышко и химические колбочки – выбирайте то, что соответствует Вашему образу жизни, Вашим желаниям и устремлениям – и обычные задачи станут более интересными, а рабочие будни будут раскрашены в новые, яркие цвета. ','Оригинальные курсоры на все случаи жизни','5d62e368e4305.png','2019-08-25 16:37:12','2022-10-26 03:43:24'),(12,'Праздники','Holidays','Días festivos','prazdniki',0,0,'Обожаете праздники? Да кто же их не любит – друзья, подарки, опять-же выходные. Чтобы ожидание праздников было более приятным, коротким и согревающим, можно не просто считать по календарю дни, но также установить в качестве курсора мыши соответствующий значок.\r\nНачнем, пожалуй, с Нового года – выберем елку, подарок или Деда Мороза, чтобы праздник был ярким и веселым. Может быть ближе будет пряничный человечек – забавный, милый и всегда веселый? С ним уж точно некогда будет грустить и скучать.\r\nПродолжим праздновать с амурами и веселыми сердечками, а там уже и до Пасхального кролика недалеко. Где-то среди праздников встретится День Рождения, который еще приятнее будет ждать с шарами вместо стандартной стрелки курсора. А в Хэллоуин можно удивить коллег и окружающих необычным курсором мышки в виде зловещей тыквы или привидения.\r\nНабор курсоров для праздников – это возможность скрасить ожидание, заранее настроиться на предстоящее веселье и поддерживать отличное настроение не только накануне торжества, но и на протяжении всего года. ','Что там по календарю? Новая коллекция курсоров «Праздники»!','5d62e3ae86dae.png','2019-08-25 16:38:22','2022-10-26 03:43:24'),(13,'Флаги','Flags','Banderas','flagi',0,0,'Флаг – это уникальный символ, который широко используется во всех социальных сетях. Мы подумали, а почему бы не сделать курсор в виде флага? Ведь это действительно ярко и необычно. Теперь Вы можете каждый день проводить в компании с новой страной, а работа станет не такой однообразной и скучной.\r\nКурсоры для мышки можно теперь оформить в государственный флаг Китая или США, Японии или Канады, и еще в 38 вариантов флагов, причем можно выбрать как стандартную форму стрелки в необычной расцветке, так и курсор в форме самого флага.\r\nЭтот набор понравится всем любителям путешествий. С ним можно планировать новые поездки и мечтать о дальних странствиях. Запланировали отпуск? Покажите всем, в какую страну Вы хотите отправиться. Может быть, Вы решили выучить новый иностранный язык? Тогда этот курсор точно поддержит Вас и мотивирует тщательно заниматься. Или Вы, как Шелдон, просто любите флаги? Во всех случаях коллекция курсоров «Флаги» станет прекрасным дополнением рабочего стола и сподвигнет Вас на новые открытия. ','В поисках приключений: куда отправимся сегодня?','5d62e3d018639.png','2019-08-25 16:38:56','2022-10-26 03:43:24'),(14,'Вокруг Света','Around the world','Alrededor del mundo','vokrug_sveta',0,0,'Все любят путешествия. Как это прекрасно – побывать в новых странах и городах, увидеть достопримечательности и прекрасно провести время в новой культуре. Как жаль, что путешествовать мы можем не так часто, но мы попытались это исправить.\r\nНабор курсоров «Вокруг света» – это коллекция самых ярких изображений, символов разных стран, с помощью которых даже сидя дома можно ощутить себя настоящим путешественником. В нашем наборе Вы можете найти Японию и Австралию, Италию и Канаду, США и Мексику – самые интересные, оригинальные и живописные страны в мире.\r\nКартинка курсора может стать стандартной стрелкой, в расцветке флага страны, или стать одной из самых основных достопримечательностей государства. Например, Вы можете открывать документы Пизанской башней, а презентацию проводить с помощью Статуи Свободы. Гарантируем – успех будет обеспечен. Ну, или если не успех, то улыбки коллег и признание в оригинальности – точно. Да и намекнуть руководству, что пора в отпуск, будет тоже нелишним – просто установите в качестве курсора чемодан или самолет – и наверняка очень скоро Вы отправитесь в полет. ','Вокруг света за мгновение: куда отправимся сегодня?','5d62e3ee5ba5b.png','2019-08-25 16:39:26','2022-10-26 03:43:24'),(15,'Еда и напитки','Food and drinks','Alimentos y bebidas','eda_i_napitki',0,0,'Набор курсоров в виде продуктов – это невероятная коллекция ярких, вкусных и аппетитных картинок, которые точно понравятся всем и станут прекрасным дополнением рабочего стола. Вы никогда не кликали по документам брокколи или картошкой фри? У Вас появилась такая возможность – просто скачайте новый набор курсоров и установите их вместо скучной белой стрелочки.\r\nКурсоры «Еда» выполнены как в форме стандартного треугольного указателя, так и в форме продуктов. Здесь найдутся овощи и фрукты, любимые блюда, такие как пицца или хот-доги, кофе, леденцы и много всего другого, что поднимает настроение в любой день.\r\nЛюбите кофе, но пить его весь день не так полезно? Дополните свой рацион виртуальным кофе, который также взбодрит и разбудит Вас, а еще подарит яркие эмоции. Крутой курсор в виде виртуального пончика не повредит фигуре, при этом подарит яркие эмоции и развеселит. Вы можете пользоваться любимыми курсорами или менять изображение каждый день – большой выбор курсоров поможет раскрасить будни и внести новые краски в привычные действия.','Аппетитные курсоры для креативности','5d62e40a1e114.png','2019-08-25 16:39:54','2022-10-26 03:43:24'),(16,'Цветные','Colored','De colores','cvetnye',0,0,'Курсор – это основной элемент рабочего стола, с которым мы проводим весь рабочий день, учимся, общаемся и расслабляемся. Стандартный вид курсора – это скучно и даже несколько угнетающе, но все же многим людям такая форма удобна, и менять ее будет некомфортно.\r\nНо и для этой ситуации у нас есть решение – набор курсоров в ярких, жизнерадостных цветах, которые внесут разнообразие в Ваши будни и сделают решение любых задач более легким и быстрым. Если Вы задумались, как изменить цвет курсора, отвечаем – скачивайте нашу коллекцию и выбирайте яркие решения на каждый день!\r\nВы можете выбрать монохромные тона в разных цветах под настроение или специфику работы. Например, при работе со стандартными документами, выделяться на фоне будет фиолетовый курсор, а на темном фоне, наоборот, легче работать будет с желтыми курсорами. Если Вы хотите взрыва цвета, яркости и максимальной оригинальности – выбирайте радужный курсор, который включает все цвета спектра – с таким значком настроение точно будет прекрасным на протяжении всего дня. ','Да здравствует буйство красок и яркость цвета!','5d62e43843698.png','2019-08-25 16:40:40','2022-10-26 03:43:24'),(17,'Пранк','Pranks','Bromas','prank',0,0,'Шутки на работе не всегда приветствуются, поскольку часто мешают рабочему процессу. Но с новым набором курсоров «Для розыгрышей» Вы можете по-доброму подшутить над своими коллегами или друзьями без ущерба работе или учебе.\r\nМы разработали специальную коллекцию, которая развеселит любого и даст повод немного отдохнуть среди напряженного процесса работы или выполнения иной задачи. Чтобы изменить курсор мыши, достаточно скачать набор на устройство и в параметрах выбрать понравившееся оформление.\r\nНапример, можно получить курсор стандартной формы, но в перевернутом состоянии или стрелку, изогнутую волной. Такая форма нисколько не затруднит процесс работы, но при этом подарит прекрасное настроение и настроит на позитивный лад.\r\nМеняйте параметры отображения курсора по настроению или каждый день – и любая задача станет более интересной и приятной, а будни перестанут вызывать негативные эмоции. При этом такие курсоры можно использовать даже для серьезных проектов – они имеют нейтральные цвета и не выделяются на фоне рабочего стола. ','Набор курсоров для самых веселых шалостей','5d64d07086037.png','2019-08-27 03:40:48','2022-10-26 03:43:24'),(18,'Стартовый набор','Starting kit','Kit de inicio','startovyj_nabor',0,0,'Курсоры из стартовой коллекции представляют собой микс стандартных форм и размеров с ярким, необычным оформлением. Это отличный выбор для тех, кто предпочитает привычные формы, но хочет внести в повседневность разнообразие, оригинальность и яркость.\r\nВ коллекции есть курсор рука и привычная стрелочка в самых разных вариациях – от эмблемы Гугл Хрома до оформления смайликами, здесь даже можно встретить давно забытого дракончика с кактусами и поностальгировать. Мы доказываем, что стандартный курсор тоже может быть интересным и привлекательным. Разные цвета, формы, фактуры и интересное оформление помогут Вам выбрать курсор на свой вкус или менять его каждый день в зависимости от настроения или выполняемых задач.\r\nМеняются курсоры браузера очень просто – достаточно установить расширение и скачать коллекцию на свое устройство. Забавные, интересные курсоры не только раскрасят рабочие дни, но также, например, помогут сделать любую презентацию более интересной, а с помощью особенно ярких курсоров – еще и привлечь внимание к отдельным элементам доклада. ','Новый взгляд на привычные вещи: обновленная серия курсоров','5d64d6e3956db.png','2019-08-27 04:08:19','2022-10-26 03:43:24'),(20,'Fortnite','Fortnite','Fortnite','fortnite',0,0,'Игра Fortnite покорила миллионы людей во всем мире. Захватывающие сражения, стратегия и тактика, приключения – она вобрала в себя абсолютно все, что так нравится игрокам. Мы не смогли остаться в стороне и разработали набор курсоров в стиле игры, которые понравятся не только заядлым геймерам, но даже тем, кто о Fortnite услышал впервые.\r\nЗначок курсора Fortnite – это изображение героя или его оружия, проработанное до мельчайших подробностей. Здесь можно встретить изображения лисы и рыбы, маски инферно и черного рыцаря, установить себе в качестве стрелки боевой топор или косу с шипами. Мы уверены – равнодушным не останется никто! Быть страшным или загадочным, оригинальным или юморным – решать только Вам. Выбирайте свой стиль и следуйте ему или задавайте в настройках кастомные курсоры и каждый день меняйте свое амплуа.\r\nТеперь выполнять даже нудную и однообразную работу станет намного интереснее и приятнее – время пролетит незаметно в компании с яркими изображениями и любимыми героями. А может, Вы устроите соревнования с коллегами, какой герой окажется сильнее? Выбор за Вами!','Вперед за стримерами!','5d83869f09be6.png','2019-09-19 10:46:07','2022-10-26 03:43:24'),(21,'DOTA 2','DOTA 2','DOTA 2','dota_2',0,0,'DotA2 давно уже перешла от разряда простой игры к настоящему параллельному миру. В виртуальной реальности в Доте можно все – жить, сражаться, развиваться, путешествовать, находить друзей. В общем, все как в жизни, только в разы интереснее. Курсоры Дота 2 – это продолжение стратегии, которые позволят в реальном мире получить яркие эмоции и выразить себя.\r\nНовый набор курсоров включает в себя самых ярких персонажей игры, а также оригинальные предметы, которые не спутать больше ни с чем другим. Выбирайте курсор, который будет Вам более близок – и вступайте в приключение, не покидая своего рабочего места.\r\nКак скучно порой бывает находиться на работе или выполнять учебные задачи, но с игровыми курсорами эта проблема больше не встанет перед Вами. Немного фантазии, яркий курсор – и вуаля, любое дело станет необычным приключением, справиться с которым Вам будет не сложно и интересно.\r\nНе нужно сдерживать себя. Вы любите Доту? Тогда обязательно скачивайте нашу коллекцию, выбирайте один или сразу несколько рандомных курсоров – и каждый новый день станет ярче, интереснее и насыщеннее.','Перенеси виртуальный мир в реальный','5d83a2af0c7b2.png','2019-09-19 12:45:51','2022-10-26 03:43:24'),(22,'Майнкрафт','Minecraft','Minecraft','minecraft',0,0,'Курсоры для мыши в виде стандартных стрелочек и пальцев уже давным-давно всем приелись. Если Вы – любитель необычного и оригинального, значит, пора изменить курсор мыши и придать ей более интересный дизайн.\r\nМы разработали коллекцию курсоров в стиле всемирно известной игры Майнкрафт, где можно найти самых ярких персонажей. Волк и лисичка, Алекс и Крипер, алмазный меч и рыбка – Вы можете выбрать того, кто Вам наиболее симпатичен или каждый день устанавливать нового героя. Это самые настоящие курсоры для геймеров, причем они понравятся абсолютно всем – ведь кто из нас не играл в Minecraft? Уверены, таких просто не существует.\r\nДолой скучные будни – пора окунуться в приключения, что можно сделать даже не выходя из дома или офисного кресла. Подготавливать отчет и сводить баланс будет интереснее с ружьем – любая задача станет приятнее и не даст заскучать на месте.\r\nСкачивайте новую коллекцию курсоров Майнкрафт – устанавливайте их и даже в самый серый и скучный день Ваше настроение всегда будет на высоте. А коллеги будут завидовать Вашим результатам – ведь просто невозможно не сделать свою работу с помощью отважных героев Майнкрафт.','Персонажи любимой игры всегда рядом','5d90968b5231b.png','2019-09-29 11:33:31','2022-10-26 03:43:25'),(23,'Пять ночей у Фредди','Five Nights at Freddy\'s','Cinco Noches en Freddy\'s','five_nights_at_freddy',0,0,'По-настоящему уникальная игра Five Nights at Freddy\'s быстро обрела широкую популярность и это не удивительно, ведь ее простой и в то же время увлекательный сюжет, способен часами продержать игроков у экранов. Мы разработали курсоры Five Nights at Freddy\'s по просьбе фанатов игры и получили большое удовольствие воплощать таких интересных и забавных персонажей.\r\nНо в отличии от игры, с нашими курсорами вам ничего не угрожает, так что смело выбирайте любимого аниматроника, будь то курсор Медведь Фредди или Кролик Бонни или другие. Главное, что теперь игра оживает в вашем браузере и дарит свежие эмоции.\r\nГарантируем - в наших курсорах нет призраков, но они прекрасно передают дух игры, которая наводит страх благодаря тонкостям дизайна и элементам сюжета. А что если сделать размер курсора очень большим? Сможете сохранить спокойствие и не испугаться?','Попробуй не испугаться этих аниматроников','5d9f832f04235.png','2019-10-10 19:14:55','2022-10-26 03:43:23'),(24,'Команды НФЛ','National Football League','Liga Nacional de Fútbol','nfl_teams',0,0,'Что может быть лучше для истинного ценителя американского футбола, чем курсор мыши в виде символики команды, за которую он болеет? В современной Национальной футбольной лиге играют тридцать две команды, разделенные между Национальной и Американской футбольными конференциями (National Football Conference, NFC и American Football Conference, AFC). В свою очередь каждая из конференций разделена на четыре дивизиона: Восток, Север, Юг и Запад. Сезон NFL состоит из \"предсезонных\" игр, регулярного чемпионата и серии игр \"плей-офф\". Финальный матч сезона НФЛ называется \"Супер Боул\" и по сути является самым популярным спортивным событием в США. Это любимая игра для миллионов фанатов и поэтому мы создали коллекцию курсоров НФЛ, чтобы вы не расставались с символикой любимой команды. Будь то Нью-Ингленд Пэтриотс, Нью-Йорк Джайентс,  Баффало Биллс или другая команда, будьте всегда на одной волне с вашими кумирами, с помощью наших курсоров в виде логотипа команды и шлема. Коллекция будет постоянно дополняться, чтобы каждый мог изменить курсор на изображение любимой команды.','Для настоящих футбольных фанатов','5da228cfa7cf9.png','2019-10-12 19:26:07','2022-10-26 03:43:23'),(25,'Хеллоуин','Halloween','Halloween','halloween',0,0,'Бойся пропустить новую коллекцию в честь Хеллоуина','Бойся пропустить новую коллекцию в честь Хеллоуина','5da893a9b7300.png','2019-10-17 16:15:37','2022-10-26 03:43:23'),(26,'The Elder Scrolls','The Elder Scrolls','The Elder Scrolls','the_elder_scrools',0,0,'Это супер игра и здесь описание к этой категории','Добро пожаловать в мир драконов','5daf52fcac534.png','2019-10-22 19:05:32','2022-10-26 03:43:23'),(27,'Знаменитости','Celebrities','Celebridades','famous_people',0,0,'Среди множества известных людей, каждый из нас находит образец для подражания или просто восхищается гением, талантом и упорством этих знаменитостей. Мы подготовили коллекцию курсоров знаменитостей, чтобы вдохновлять вас и напоминать о великих достижениях, которые каждый из вас, может приумножить. Не всех известных личностей ждала счастливая судьба, но они учат нас главному, что никогда не нужно отступать от заветной цели, несмотря на сложности и проблемы. Ведь это основной принцип достижения успеха — идти к своей мечте каждый день и наконец, стать лучшим в своем деле. Возможно сегодня вы просто хотите изменить курсор своей мыши, а завтра изменится к лучшему вся ваша жизнь! Коллекция будет постоянно пополняться новыми, достойными представителями человечества. Среди них безусловно ученые, политики, спортсмены, представители искусства и многие другие. В коллекцию уже добавлены курсор Джордж Вашингтон, курсор\r\nМайкл Джордан, курсор Стивен Кинг, курсор Элвис Пресли и курсор Мэрилин Монро — это только начало.','Вдохновитесь курсором в виде своего кумира','5db05301d93a7.png','2019-10-23 13:17:53','2022-10-26 03:43:23'),(28,'Покемоны','Pokemon','Pokemon','pokemon',0,0,'Слово «покемон» означает существо, имеющее сверхъестественными способности. Они обладают разумом, а некоторые из них даже способны разговаривать. В данный момент существует уже 802 разновидности покемонов. В придуманной вселенной «Покемона» людей называют тренерами покемонов, которых они обучают для сражений с покемонами других тренеров. И чем опытнее и сильнее тренер, тем большим уважением он пользуется. К счастью, надо заметить, что схватки покемонов никогда не заканчиваются смертью этих уникальных существ. Все покемоны обладают разными способностями и отличаются по типу стихии и от этого сильно зависит его устойчивость к разным атакам, а некоторые существа обладают способностями сразу двух стихий. После победы в схватке, покемону достается ценный опыт, который необходим для повышения уровня и соответственно его характеристик. Сегодня вселенная покемонов — это огромная медиа-франшиза и мы реши подготовить для вас коллекцию курсоров с некоторыми популярными покемонами. Среди них самый известный — Пикачу курсор, а также Раттата курсор, Сквиртл курсор, Бульбазавр курсор, и Чармандер курсор. Этот список будет пополняться, ведь их так много и каждый из них уникален по своему.','Поймай их всех, если сможешь','5db7407042eaf.png','2019-10-28 22:24:32','2022-10-26 03:43:23'),(29,'Fortnite Chapter 2','Fortnite Chapter 2','Fortnite Chapter 2','fortnite_chapter_2',0,0,'Вторая глава Fortnite пришла вслед за грандиозным событием - The End, которое затянуло все, что любили игроки в игре, в черную дыру. В Fortnite Chapter 2 теперь новая карта, которая на первый взгляд еще более дикая, чем оригинальная карта, а также немало изменений в игровой механике и конечно много нового игрового контента! Транспортные средства, эмоции, плавательная механика и еще много чего - все это в свежих, интересных образах, все как вы любите и цените в этой культовой игре. Окунитесь в новый мир — выбирайте место посадки и исследуйте абсолютно новый остров с 13 локациями. Плавание, рыбалка, моторные лодки — это новый водный геймплей. Больше удовольствия и меньше усилий — прокачайте абсолютно новую главу 2 и не забудьте изменить курсор на новые скины и оружие. Вас уже ждут обновленные скины Turk курсор, Riptide курсор, Rippley курсор, Remedy курсор, Toxin курсор, 8-Ball курсор, Fusion курсор и другие!','Новая глава культовой игры Fortnite','5db7cfa3ef35a.png','2019-10-29 05:35:31','2022-10-26 03:43:23'),(30,'Финес и Ферб','Phineas and Ferb','Phineas and Ferb','phineas_and_ferb',0,0,'В вымышленном американском городе Денвилль несуществующего Триштатья, обитают два интересных мальчика. Каждый день их каникул превращается в невероятные приключения, ведь они могут сделать американские горки размером в целый город или настоящий портал на другую планету. Свои удивительные развлечения они делят с друзьями. В это же время, пока мальчики развлекаются, злобный учёный Хайнц Фуфелшмертц строит очередную машину зла, порождающую хаос, с названием, оканчивающимся на «-инатор», с помощью которой он желает отомстить за детские обиды или захватить власть в Триштатье, но ему препятствует Перри-Утконос, секретный «Агент Пи», работающий под прикрытием домашнего питомца мальчиков. Популярность этого мультсериала, как среди детей, так и среди взрослых, вдохновила нас создать коллекцию курсоров Финес и Ферб, чтобы вы могли изменить свой курсор мыши на героев из сериала. Среди них курсор Финес Флинн, курсор Доктор Хайнц Фуфелшмерц, курсор Ферб Флетчер, курсор Кендэс Гертруда Флинн и курсор Перри-утконос.','С коллекцией курсоров Финес и Ферб точно не соскучишься','5dbdb95a88771.png','2019-11-02 20:14:02','2022-10-26 03:43:23'),(31,'Губка Боб','SpongeBob','Bob Esponja','spongebob',0,0,'Мультсериал «Губка Боб Квадратные Штаны», известен очень многим людям. Он имел ошеломительный успех после того, как Nickelodeon в 1999 году решила создать анимационную серию на основе образовательного комикса «Зона прилива», и превратился в очень прибыльную франшизу. Создатель сериала – бывший работник океанологической лаборатории, именно поэтому почти все персонажи мультсериала – забавные обитатели морского дна, со своими особенностями и харизмой.\r\nДействие вращается около секретного рецепта Крабсбургера, который может приготовить только главный герой – Губка Боб. А другие обитатели морского дня пытаются заполучить его, в их числе и главный антигерой Шелдон Планктон, у которого это каждый раз не выходит.\r\nВ коллекции курсоров Губка Боб мы собрали курсоры всех примечательных персонажей и событий сериала. Например, курсор мистера Крабса с долларом, курсор Патрика Стара, Сквидварда с его кларнетом, курсор медузы, курсор Губки Боба и многих других персонажей.','Узнай, кто живет на дне океана вместе с коллекцией курсоров Губка Боб','5dc2ff8943d72.png','2019-11-06 20:14:49','2022-10-26 03:43:23'),(32,'Национальная баскетбольная лига','National Basketball Association','National Basketball Association','nba_teams',0,0,'Если для вас баскетбол – любимая игра, так же как и для нас, то коллекция курсоров, посвященных командам НБА – то, что вам нужно.\r\nНБА – это одна из топовых спортивных лиг североамериканского континента. Когда мы создавали эту коллекцию, нас мучил выбор – какую команду выбрать, ведь их в НБА тридцать. Но есть команды, которые являются легендами. Это и Chicago Bulls, установившие рекорд по победам в середине 90-х. Это и Golden State Warriors, собравшие лучших игроков лиги пару лет назад. Или, например, Lakers, Celtics – тоже безумно крутые команды.\r\nЕсли вы так же, как и мы, с нетерпением ждете матчи своих любимых баскетбольных команд, и хотите показать свою поддержку команде или игрокам – качайте нашу коллекцию НБА-курсоров.','Курсоры НБА, как символ великих баскетбольных побед','5dc837c70737b.png','2019-11-10 19:16:07','2022-10-26 03:43:23'),(33,'Время приключений','Adventure Time','Hora de aventura','adventure_time',0,0,'\"Время приключений\" представляет собой мультфильм фантастического жанра, в котором действия разворачиваются в мире, пережившем апокалипсис. Эта территория называется Земля Ооо, на которой еще недавно проходила ядерная война. Но все это уже в прошлом, однако все оставшиеся в живых люди были подвержены мутациям, а мир заполонила магия. Главные герои мультсериала – это Финн, мальчик 14-ти лет и его друг пес по имени Джейк. Мальчик и собака очень любят приключения, они постоянно помогают всем, кто попал в беду. Друзья живут на дереве, и все время проводят вместе. Если хотите вместе с другими почитателями погрузиться в приключенческий мир, то кричите «Математика». Здесь и Финн Парнишка курсор и Джейк курсор, а также Принцесса Жвачка курсор. Конечно мы не забыли про Бимо курсор, Ледяной Король курсор и других.','Учимся математике с коллекцией курсоров Время приключений','5dcafb6539c0e.png','2019-11-12 21:35:17','2022-10-26 03:43:23'),(35,'Национальная хоккейная лига','National Hockey League','National Hockey League','nhl_teams',0,0,'Национальная хоккейная лига была образована в 1917 году — это профессиональная спортивная организация, объединившая хоккейные клубы США и Канады. И это одна из первых профессиональных хоккейных лиг во всем мире. НХЛ является одной из главных спортивных лиг Северной Америки, наряду с НФЛ, НБА, МЛБ и MLS. Ежегодно 31 команда из 30 городов США и Канады, сражаются за главный трофей — Кубок Стэнли, а команда, набравшая по итогам регулярного сезона наибольшее количество очков, награждается Президентским кубком. Пришло время и нам почтить эту великую игру, создав коллекцию курсоров НХЛ. Если вы также любите хоккей, болеете за любимый клуб или сами участвуете в этом спорте, достаточно изменить курсор и не расставаться с любимой командой, среди которых Бостон Брюинз курсор, Сент-Луис Блюз курсор, Коламбус Блу Джэкетс курсор, Тампа-Бэй Лайтнинг курсор, Даллас Старз курсор и другие клубы, достойные искреннего уважения.','Коллекция курсоров НХЛ для истинных болельщиков','5ddbd5a37f639.png','2019-11-25 16:22:43','2022-10-26 03:43:23'),(36,'Рождество','Christmas','Navidad','christmas',0,0,'Каждый из нас несомненно очень ждет самый популярный праздник — Рождество. Все христиане мира, традиционно отмечают его каждый год, 25 декабря. Время, когда семьи собираются за одним столом, делятся своей радостью и любовью и обмениваются подарками. Задолго до Рождества люди украшают улицы яркими гирляндами, а свои жилища — традиционными атрибутами. Сложно отыскать человека, который не любит Рождество – веселый и загадочный праздник, ведь ему сопутствует множество традиций и ритуалов, они возвращают нас к истокам всего нашего рода. В преддверии Рождества буквально все пропитано его духом, начиная от расписных пряников и заканчивая трогательными песнопениями. Нарядная елка и подарки под ней, радость, знакомая каждому из нас с самого детства. Мы хотим присоединиться к этому волшебному празднику и, кто знает, может Санта приготовит для вас особый подарок, если вы украсите свой курсор с помощью нашей Рождественской коллекции. Здесь есть все, что нужно для этого, курсор Санта-Клаус, курсор Рождественская елка, курсор пряник, курсор Снеговик и даже курсор мешок подарков. С Рождеством!','Санте обязательно понравятся ваши рождественские курсоры','5df6cdefde781.png','2019-12-16 03:21:03','2022-10-26 03:43:22'),(37,'Brawl Stars','Brawl Stars','Brawl Stars','brawl_stars',0,0,'Brawl Stars — мобильная игра в жанре MOBA от компании Supercell. Несмотря на релиз в конце 2018 года, игра обрела большую популярность, во многом из-за обилия режимов сражений и красочных, фантастических героев — драков. Игроку есть из чего выбрать - 32 уникальных героя и каждый из них обладает своим набором способностей и навыков. Каждый герой также своим пассивным навыком, который доступен с помощью сундуков с добычей. Игроки могут сражаться в нескольких режимах, к примеру «Награда за поимку» — побеждает одна из двух команд, собравшая больше звезд, убивая соперников. В режиме «ограбление» необходимо сломать сейфы соперников, при этом сохранив свой. Интересный режим «Gem Grab» - победителем становится команда, побеждает команда собравшая больше драгоценных камней. Ну а в режиме «Столкновение» 10 игроков сражаются друг с другом на карте, где границы уменьшаются из-за ядовитого облака. Игра изобилует красочным дизайном, который многим по душе, в том числе и нам, что и вдохновило нас создать отдельную коллекцию курсоров Brawl Stars. Здесь присутствуют Brawl Stars Шелли курсор, Барли курсор, Пенни курсор, Френк курсор, Мортис курсор и другие.','Выбирай Brawl Stars курсоры и в бой','5e1752a360858.png','2020-01-09 19:19:47','2022-10-26 03:43:22'),(38,'Бейсбол Национальная Лига','MLB Teams','Equipos de MLB','mlb_teams',0,0,'Любителей бейсбола можно найти в каждой точке мира. Особенно это касается жителей таких стран, как: США, Китай, Куба, Южная Корея, Япония и Венесуэла. Вопреки распространённому мнению, бейсбол зародился не в Америке, а в Англии. Первое упоминание и описание бейсбола появились в далеком 1744 году, в английском издании. Через 145 лет американцы присвоили это изобретение себе, несмотря на факты.\r\nНациональная лига была образована в 1876 году. Она входит в состав Главной лиги в Канаде и США. Сегодня в Национальной лиге бейсбола насчитывается 15 команд. В финальной части каждого сезона наступает время плей-оффа, в котором принимают участие 4 лучшие команды. Так и выявляется победитель всей Национальной лиги. Затем победившая команда получает возможность сыграть против победителя со стороны Американской лиги в рамках Мировой серии.\r\nИнтересуетесь бейсболом или даже болеете за одну из команд? Тогда воздайте честь своей любимой команде, установив курсоры мыши в виде ее атрибутов! Измените скучный облик указателя в браузере на знакомый вам фирменный стиль бейсбола! Превратите стрелочку в биту или шлем игрока любой из команд Национальной лиги, среди которых уже есть в коллекции New York Yankees курсор, Great Falls Dodgers курсор, Boston Red Sox курсор, Baltimore Orioles курсор, Oakland Athletics курсор.','Коллекция курсоров Главной Лиги Бейсбола для всех наших фанатов.','5e1a29f28704f.png','2020-01-11 23:02:58','2022-10-26 03:43:22'),(39,'Рик и Морти','Rick and Morty','Rick y Morty','rick_and_morty',0,0,'Первая серия анимационной работы «Рик и Морти» вышла в 2013 году. Этот мультфильм можно отнести сразу к 2 жанрам: научная фантастика и комедия. Его создателями стали Дэн Хармон и Джастин Ройланд. Первоначально все серии показывались на канале Cartoon Network, а уже затем были дублированы в онлайн-кинотеатры и видеохостинги. Каждые несколько лет выпускаются новые сезоны «Рик и Морти», а в ноябре 2019 года вышел четвертый сезон, который оказался не менее интересным, чем предыдущие. Сюжет мультсериала крутится вокруг гениального и, в то же время, безумного ученого по имени Рик, а также его ничем не примечательного внука – Морти. Этих двух персонажей связывают совместные приключения в самых необычных местах. А попадают они туда на летающей тарелке, способной к перемещению через меж пространственный тоннель. Как вы уже могли догадаться, данный мультсериал немного напоминает фильм «Назад в Будущее», но все же не является его анимационной версией. Однако он удостоился похвал многих критиков за юмористические эпизоды, креативность и оригинальность. Хотите видеть Рика или Морти не только в сериях этого произведения, но и в браузере? Если это так, устанавливайте расширение и добавляйте нашу коллекцию, посвященную вашему любимому мультфильму! Здесь Рик Санчез курсор, Морти Смит курсор, Портальная Пушка курсор и конечно Мисикс курсор.','Хватит ворчать, просто используй курсоры из коллекции Рик и Морти','5e1a70c97b5c7.png','2020-01-12 04:05:13','2022-10-26 03:43:22'),(40,'Пушин Кэт','Pusheen','Pusheen','pusheen',0,0,'Кошку Пушин знают практически все. Даже несмотря на то, что это лишь придуманный 10 лет назад персонаж детского комикса, у него сегодня миллионы поклонников. Pusheen cat появилась в виде иллюстрации, созданной художницей Клэр Белтон.\r\nЧерез год кошка обзавелась собственной страницей в Tumblr.com и за несколько недель набрала целую армию фанатов – около 10 000 человек. В 2013 году Facebook загорелась желанием включить изображения с Пушин в коллекции с другими эмотиконами. После переговоров с создательницей, эта задумка была воплощена в жизнь и «взорвала» интернет! Картинки с Pusheen cat используются в переписке более 10 млн. раз в день!\r\nВ 2014 году один из самых масштабных производителей игрушек в США обратил свое внимание на данного персонажа. Компания GUND (это она изобрела плюшевых мишек) запустила в продажу пару моделей Пушин. Так как успех был огромный, то уже через несколько месяцев была создана полноценная коллекция игрушек в виде этой кошки.\r\nГде еще можно встретить Pusheen cat? В подарочных наборах от Isaac Morris Ltd, в зефирных коробках от компании Boomf и, конечно же, в нашей коллекции курсоров Pusheen!','Добавь уюта в браузере с коллекцией курсоров Пушин Кэт','5e38df0a89470.png','2020-02-04 06:03:38','2022-10-26 03:43:22'),(41,'Известные ютуберы','YouTubers','YouTubers','youtubers',0,0,'Видеоплатформа YouTube появилась в 2005 году. Сначала там публиковались ролики просто ради самовыражения или информирования о чем-либо. Однако со временем всё это переросло в прибыльный бизнес, который приносит успешным ютуберам тысячи, а иногда и миллионы долларов в месяц. Чем популярнее влогер (человек, который ведет видеоблог), тем больше он может зарабатывать с помощью своего канала. Сколько зарабатывает пятилетняя девочка-влогер, родители которой возят ее по самым интересным аттракционам и снимают происходящее на камеру? Просто, как ребенок веселится в детских парках, какие выражает эмоции, как дурачится и всё в таком роде. Сумма действительно поражает – сегодня канал ребенка набрал почти 47 миллионов подписчиков и стал приносить доход в размере 5 миллионов рублей ежемесячно.\r\nКто-то выкладывает ролики, где он обсуждает компьютерные игры, кто-то занимается битбоксом или устраивает пранки для прохожих на улице. Некоторые посвящают свои видео наболевшим темам, вроде отношений между мужчинами и женщинами. Чем больше такие кадры нравятся пользователям YouTube, тем выше популярность влогера. В коллекции уже добавлены Пьюдипай курсор, Шейн Доусон курсор, Рэй Уильям Джонсон курсор, Зоелла курсор, Ева Гутовски курсор и другие.','Новое поколение звезд всегда онлайн в нашей коллекции известных ютуберов','5e41397811325.png','2020-02-10 14:07:36','2022-10-26 03:43:22'),(42,'Симспсоны','The Simpsons','Simpsons','simpsons',0,0,'О таком известном мультсериале, как Симпсоны, слышали абсолютно все. Даже те люди, которые никогда не смотрели подобное, знают о существовании желтых персонажей. А фанаты просто в восторге, когда выходит очередной сезон их любимого мульта. Кстати, осенью 2019 года был выпущен 31 по счету сезон. А первый появился на экранах телевизоров в далеком 1989 году. Его начал показывать телеканал Fox и до сих пор продолжает это делать ввиду высоких рейтингов и зрительских симпатий.\r\nСимпсоны представляет собой сатирический жанр, который затрагивает актуальные темы. Это может быть образ жизни среднестатистического американца, политические и религиозные вопросы, «звездные» выходки селебрити, феминизм, однополые браки. В общем, всё, что касается местных и общемировых событий, в которых участвует США.\r\nДействие мультипликационного сериала происходит в несуществующем городке Спрингфилд. На самом деле, городов с таким названием, в Америке полно. Возможно, поэтому оно и было выбрано, чтобы зрители не ассоциировали происходящее на экранах с конкретным населенным пунктом, а лишь догадывались, где такое могло бы быть.\r\nСкорее всего, вы поклонник Симпсонов. Иначе зачем бы вы дочитали этот текст до конца? А раз так, то у вас есть возможность поменять наскучивший курсор мыши на такой указатель, который выполнен в стилистике данного мультсериала.','Веселая семейка в главных ролях коллекции курсоров Симпсоны','5e431a37e095a.png','2020-02-12 00:18:47','2022-10-26 03:43:22'),(43,'Гравити Фолз','Gravity Falls','Gravity Falls','gravity_falls',0,0,'«Грэвити Фолз» был создан совместными усилиями корпорации Disney Television Animation и Алекса Хирша. Премьера вышла в 2012 году и была показана на Disney Channel. Там же крутился весь первый сезон мультсериала. Через два года был выпущен второй сезон, который зрители могли посмотреть и на прежнем канале, и на Disney XD. К сожалению, третьего и последующих сезонов поклонники Gravity Falls не дождались. Создатели решили ограничиться двумя сезонами без каких-либо продолжений.\r\nЧто касается сюжета этой анимационной картины, то все действия разворачиваются в выдуманном городе под названием Грэвити Фолз. Туда приезжают два близнеца, которых зовут Мэйбл и Диппер. Они гостят у своего двоюродного дедули Стэна. У него свой собственный магазин с сувенирами для туристов. Когда братьям наскучивает «ничегонеделание», они отправляются на поиски приключений. Один из них находит в лесу странный дневник, в котором рассказывается об аномалиях этого городка. Близнецы отправляются на поиски его автора и сталкиваются с необычными существами и местами. Если вам интересен этот мультсериал, и вы когда-то фанатели от его персонажей, советуем вам нашу коллекцию курсоров мыши в стилистике Gravity Falls!','Отправляемся на поиски приключений с коллекцией курсоров Гравити Фолз','5e458400711a1.png','2020-02-13 20:14:40','2022-10-26 03:43:22'),(44,'Супер Марио','Super Mario','Super Mario','super_mario',0,0,'Супер Марио – это целая серия компьютерных игр, выпущенных Nintendo. Первая и самая популярная игра называлась Super Mario Bros. Она увидела свет еще в 1985 году. Позднее ее занесли в Книгу Рекордов Гиннесса. С тех пор было выпущено еще более 20 игр, каждая из которых имела свой собственный сюжет. В 2019 году появилась новая версия под названием Super Mario Maker 2. Несмотря на улучшение графики, стилистика и персонажи остались прежними, а это навевает ностальгию по Super Mario 80 годов.\r\nГлавный герой – по-прежнему водопроводчик Марио. В сюжете последней вариации игры от замка принцессы не осталось и камня на камне. Марио должен отстроить его заново, заработав перед этим монеты, которые ему выплачиваются за задания. Всего в этой игре более 100 различных по сложности уровней с возможностью модификации. Также в Super Mario Maker 2 появились новые игровые режимы. Можно играть сразу вчетвером и как только один финиширует, уровень засчитывается пройденным. Также есть такие режимы, как: Марафон Марио, Поединок и Ниндзик-забеги.\r\nОбожаете Super Mario и всё, что связано с этой замечательной игрой? Тогда устанавливайте курсоры, выполненные в стилистике данного платформера! Уверены, что вам понравятся Марио курсор, Луиджи курсор, Принцесса Пич курсор и другие курсоры, которые представлены в нашей коллекции!','Вперед, через грибное королевство с коллекцией курсоров Супер Марио','5e499258d14f8.png','2020-02-16 22:04:56','2022-10-26 03:43:22'),(45,'Deltarune','Deltarune','Deltarune','deltarune',0,0,'Deltarune – ролевая игра, выпущенная для компьютеров пару лет назад. Она была создана тем же программистом, который разработал Undertale. Однако эти две игры почти не похожи друг на друга, хоть и имеют парочку общих персонажей и локаций.\r\nВ «Дельта Руне» главных героев несколько. Это школьник Крис, которым можно управлять, и очаровательный монстр Сьюзи, не поддающийся никакому контролю. Оба персонажа попадают в мир тьмы, где встречают одного из его обитателей – Ральзея. Тот им рассказывает, что на самом деле они светлые создания, у которых есть миссия – остановить поток темной энергии в сумрачном мире. Для этого им нужно щадить местных монстров и стараться не вступать с ними в бой, хоть это иногда довольно непросто делать.\r\nУ игрока есть простой выбор: либо щадить темных созданий, либо атаковать их. Так как Сьюзи не любитель полумер, она во многих случаях выбирает сражение. Поэтому Крису не остается ничего другого, как поддерживать свою подругу и помогать ей в боях.\r\nОбожаете игру Deltarune? Тогда стилизуйте курсор своей мыши в браузере под одного из ее персонажей! Сделать это можно при помощи нашего расширения. Установите его, добавьте коллекцию «Руна Дельта» и активируйте! Теперь ваша стрелочка перестала быть такой же, как у всех, и стала Крисом, Сьюзи или одним из существ темного мира.','Окунись в темный мир с этой коллекцией курсоров','5e4c62d28bc89.png','2020-02-19 01:18:58','2022-10-26 03:43:22'),(46,'Undertale','Undertale','Undertale','undertale',0,0,'В древние времена Землю населяли не только люди, но и монстры. Из-за разногласий между ними началась война, которая закончилась в пользу человеческой расы. Семерка магов загнала монстров под землю и заключила их там на веки вечные при помощи барьерного заклятия. Однако остался один вход в горе Эботт, которым и воспользовался ребенок. Именно за него вы и будете играть, запустив компьютерную игру Undertale.\r\nДанная игра была разработана Тоби Фоксом – известным программистом из США. Сначала ею могли насладиться владельцы персональных компьютеров под управлением Microsoft Windows и Linux OS, а затем пришел черед пользователей игровых приставок. \r\nКакой смысл этой игры? Мальчик путешествует по подземному миру, населенному монстрами. Некоторые из них сразу проявляют враждебность, а другие любят поговорить. Игрок может выбрать одну из 2 моделей поведения: избегать насилия или сражаться. В первом случае, проходить игру будет легче, во втором – наоборот сложнее. Также от данного выбора зависят сюжет и концовка, которые могут разветвляться и меняться.\r\nЕсли вам нравится «Подземная сказка» и вы хотели бы видеть ее персонажей в своем браузере, установите расширение и добавьте соответствующую коллекцию курсоров! Превратите скучный указатель мыши в одного из монстров или главного героя Undertale!','Пора выбираться из ямы с помощью курсоров Undertale','5e4cf9dbcb42a.png','2020-02-19 12:03:23','2022-10-26 03:43:22'),(47,'Кирби','Kirby','Kirby','kirby',0,0,'История видеоигры «Кирби» началась аж в 90 годах прошлого века. Она состоит из множества серий, которые были разработаны компаниями Nintendo и HAL Laboratory. Игра предназначается для детей от полутора до 8 лет. О ее популярности можно судить по количеству проданных экземпляров. Более 34 миллионов во всем мире.\r\nГлавным героем Kirby является одноименное розовое создание. Оно живет на планете, которая называется Pop Star, и периодически защищает ее от различных опасностей. Кёрби может вдыхать в себя некоторые предметы и своих врагов, чтобы затем перенимать их способности: рукопашный бой, владение мечом, огненное дыхание и т.д. Однако розовый пухлячок не только сражается с недругами, но и решает различные головоломки, путешествует по другим странам и даже может летать по уровню.\r\nПоиграть в данную видеоигру можно на консолях Nintendo или Game Boy. Во всех сериях присутствуют милые герои, неплохая графика и веселые саундтреки. Кстати, за почти 30 лет с момента выпуска первой версии мир успел увидеть 20 серий Kirby. Данный показатель вкупе с многомиллионным объемом реализованных экземпляров помог игре оказаться в ТОП-50 самых успешных и востребованных видеоигр в гейм-индустрии.\r\nЛюбите Кирби так, что хотели бы видеть данного персонажа везде, где это возможно? Тогда воспользуйтесь коллекцией Kirby и превратите обычный указатель мыши в главного героя своей любимой видеоигры! Уверены, что вам понравится новый облик курсора.','Попробуй вдохнуть всю коллекцию курсоров Кирби','5e4fa1de0177d.png','2020-02-21 12:24:46','2022-10-26 03:43:22'),(48,'Закусочная Боба','Bob\'s Burgers','Hamburguesas de Bob','bobs_burgers',0,0,'Мультсериал Bob’s Burgers переводится на русский как «Закусочная Боба». Некоторые привыкли называть «Бургер Боб». Но не важно, какой из вариантов более корректный, ведь главное – это сюжет анимационной работы и харизматичность героев. И, судя по номинации на премию «Эмми» и признанию произведения одним из лучших мультфильмов во всем мире, «Закусочная Боба» действительно произвела фурор.\r\nСюжет мультипликационного сериала крутится вокруг семьи Боба Белчера. Этот человек является владельцем закусочной на первом этаже, а на втором живет он и его близкие. У Боба есть веселая жена Линда и 3 детей: Джин, Луиза и Тина. Мальчик мечтает о музыкальной карьере, старшая дочь Тина очень добрая, но неловкая, а младшенькая – Луиза та еще шалунья и зачастую ставит свою семью в неудобное положение. Главный конкурент Bob’s Burgers – это Jimmy Pesto\'s Pizzeria. Как можно догадаться, владельца этой пиццерии зовут Джим, и они с Бобом ненавидят друг друга. Всё это обыграно так, чтобы смотрелось комично, не всерьез. Поэтому многие их перепалки вызывают лишь улыбку.\r\nЕсли вы любите мультсериал «Закусочная Боба» и хотите видеть его персонажей не только на экране монитора или ТВ, устанавливайте расширение, добавляйте коллекцию, посвященную «Бургер Бобу», и меняйте курсор мыши в браузере на любого из героев этого мультфильма!','Боб делает бургеры, а мы делаем курсоры Закусочная Боба','5e57bfb964c54.png','2020-02-27 16:10:17','2022-10-26 03:43:22'),(49,'Веб медиа','Web Media','Web Media','web_media',0,0,'В современных реалиях интернетом пользуются практически все. Начиная от детей ясельного возраста и заканчивая пенсионерами. Кто-то сёрфит с помощью браузера, другой смотрит видеоролики на YouTube, а кому-то Сеть нужна для общения с близкими. Любой из этих пользователей не может представить себе и дня без Всемирной Паутины.\r\nПожилые люди чаще всего засиживаются в социальной сети, вроде Facebook или Одноклассников. Также они зачастую общаются со своими детьми и внуками по Скайпу. Это особенно удобно, если дети и родители живут в разных городах или даже странах.\r\nМолодежь предпочитает общаться через Вайбер или Телеграм, выкладывать фото в Instagram, смеяться над мемами ВК. Ролики с реакциями людей на Ютубе набирают миллионы просмотров, так же, как и различные пранки или социальные эксперименты. В Тик-Токе танцуют, показывают фокусы и самовыражаются сотни тысяч людей.\r\nВы увлекаетесь или просто часто пользуетесь каким-то ресурсом из сферы веб-медиа? Хотите избавиться от скучной стрелки мыши в своем браузере? Тогда устанавливайте расширение и меняйте курсор по умолчанию на наш креатив! Это может быть курсор YouTube, курсор Вайбер, курсор Google Chrome или других ресурсов.','Живите в современном ритме с коллекцией курсоров веб медиа','5e5e6931d49a2.png','2020-03-03 17:26:57','2022-10-26 03:43:22'),(50,'Милые курсоры','Cute Cursors','Cursores lindos','cute_cursors',0,0,'Наверняка, вы слышали выражение «Красота спасет мир»? Так вот, многие люди, в особенности девушки, согласны с этим высказыванием. Поэтому они стремятся себя окружить всем самым красивым и приятным для взора. Это могут быть розовые обои в спальне, мягкие игрушки, вышитые бисером подушки, драгоценные украшения и т.д. Со стороны это всё смотрится очень мило и даже немного по-детски. Но ведь каждый из нас в душе немного ребенок, так почему же не позволить ему проявить свою фантазию?\r\nУмиление в нас может вызвать очень многое. Например, жалостливые глаза котенка, который хочет, чтобы его погладили или накормили. Разноцветная радуга, выглянувшая после весеннего дождичка и переливающаяся всеми цветами на солнышке. Ребенок, которого угостили шоколадкой, а он решил поделиться ею со своей подругой или другом. Поводов для умиления довольно много, и мы решили их задействовать в роли курсоров.\r\nНадоела скучная белая стрелочка в браузере? Замените ее чем-то милым из нашей коллекции! К примеру, розово-белой единорожкой, печальной помидоркой, задумчивым облачком, колючим кактусом в форме котика или всем тем, чем захотите. Всё, что вам для этого нужно сделать, установить расширение «Прокачай Курсор» и добавить в него коллекцию милых курсоров. И да здравствует спасительница мира – красота!','Мир станет добрее с коллекцией милых курсоров','5e5e704f1430d.png','2020-03-03 17:57:19','2022-10-26 03:43:22'),(51,'Гриффины','Family Guy','Chico de familia','family_guy',0,0,'Анимационный ситком под названием «Гриффины» за всю историю своего существования 4 раза брал премию «Эмми» и 3 раза «Энни». Мультсериал высмеивает наболевшие темы американского общества, такие как: феминизм, рабство, ожирение, политика и т.д. В отличие от других произведений, здесь используются врезки с шутками и сарказмами. При этом они во многих случаях не интегрированы в сюжет, а существуют сами по себе.\r\nОдин эпизод мультипликационного сериала создается на протяжении 10 месяцев. Почему так долго? Потому что вся анимация рисуется вручную. Из-за этого некоторые освещаемые произведением события успевают утратить актуальность. Но даже так ситком остается весьма интересным и завоевывает расположение зрителей во всем мире. Ведь кто не любит хорошо посмеяться над политиками, селебрити или людьми, которые совершают дикие выходки и тем самым удивляют или даже шокируют обывателей.\r\nЛюбите «Гриффинов»? У вас есть уникальная возможность превратить обычный курсор мыши в любого из персонажей данного мультсериала! Что для этого нужно сделать? Просто установите браузерное расширение «Прокачай Курсор», добавьте в него коллекцию, посвященную «Гриффинам», и наслаждайтесь сказочным перевоплощением!','Коллекция курсоров Гриффины для ценителей особого юмора','5e5ffe2a343da.png','2020-03-04 22:14:50','2022-10-26 03:43:22'),(52,'Вселенная Стивена','Steven Universe','Steven Universe','steven_universe',0,0,'Создательницей «Вселенной Стивена» стала Ребекка Шугар. Она известна своей предыдущей работой под названием «Время приключений». Первый эпизод Steven Universe вышел на видеоплатформе YouTube весной 2013 года. Но уже осенью американский канал Cartoon Network начал транслировать его для своих телезрителей. С тех пор было выпущено 6 сезонов. Шестой обещает быть финальным.\r\nЧто касается сюжета мультсериала, он крутится вокруг команды «Кристальные Самоцветы». Она состоит из инопланетных существ с характерными именами: Жемчуг, Аметист и Гранат. Но есть в ней еще один участник, в роли которого выступает обычный мальчик Стивен. Вместе они ищут чудовищ и пытаются их обезвредить, чтобы те не захватили Землю в корыстных целях. Им противостоят Яшма и Перидот – посланницы с их родной планеты, которые хотят одержать победу над Самоцветами и включить Кластер.\r\nЕсли вы фанатеете от Steven Universe и хотите видеть персонажей мультсериала везде, где только можно, устанавливайте расширение «Прокачай Курсор»! Зачем это делать? Вы сможете добавить коллекцию, посвященную «Вселенной Стивена», и превратить стандартный указатель мыши в одного из любимых героев.','Раскрой тайну самоцветов с коллекцией курсоров Вселенная Стивена','5e655bc2a753a.png','2020-03-08 23:55:30','2022-10-26 03:43:21'),(53,'Амонг Ас','Among Us','Among Us','among-us',0,0,'Among Us создана по мотивам известной ролевой игры «Мафия». Планировалось, что игра станет эксклюзивной для мобильных устройств, ведь в ней была всего одна карта. Игра стремительно стала популярной. Позже команда разработчиков добавила многопользовательский режим, а в 2019 году были выпущены две дополнительные карты.\r\nAmong Us — игра от третьего лица с видом сверху, игрок может перемещаться во всех направлениях. В одном раунде могут играть от четырёх до десяти игроков. В начале игры каждому тайно выдаётся роль предателя или члена экипажа. Impostor (в русском переводе «Предатель») может прятаться в вентиляционном люке, устраивать саботажи и убивать членов экипажа. Его цель заключается в уничтожении всех членов экипажа, либо уничтожении космического корабля путём саботажа. Целью же экипажа корабля является решение разных головоломок, подготовленных для них на старте игры. В случае, если каждый из членов экипажа выполнит все задания, то предатели проиграют. Также экипаж корабля может достичь победы путём ликвидации предателей во время голосования.\r\nПредатели могут время от времени совершать саботаж и если поломки не будут исправлены за 30 секунд, экипаж проиграет. Перед стартом игры, вы можете выбрать цвет персонажа, за которого играете, синий, красный, желтый, серый - любой! И не забудьте также установить себе соответствующий курсор из новой коллекции Амонг Ас!','Не дайте себя обмануть в этой запутанной космической игре с курсорами Among Us','601596f897580.png','2021-01-30 20:27:20','2022-10-26 03:43:21'),(54,'Адопт Ми!','Adopt me!','Adopt me!','adopt-me',0,0,'Очень популярная онлайн-игра Adopt Me стартовала в 2017 году и стала самой востребованной на игровой платформе Roblox. Суть игры очень проста - получай яйца с питомцами и ухаживай за этими милыми домашними животными. \r\n\r\nВиртуальные питомцы разделены на 5 классов, некоторые из них очень редкие и дорогие, а другие заполучить совсем просто. Это группы Uncommon, такие, как курсор Blue Dog, Common, Rare, например, курсор Adopt Me Monkey для мыши, а также ультра-редкие, такие, как курсор с Коалой, и Legendary, курсор с Dragon и Прими меня единорог. Если у игрока есть четыре взрослых питомца одного и того же типа, они могут объединиться в неонового питомца, такого как игровой курсор Neon Horse или Adopt Me Neon Starfish. Соединив  четыре обычных питомца, можно сделать неонового, который действительно светится, а из неоновых питомцев можно создать Мега-Неонового питомца.\r\n\r\nПокупки в игре Adopt Me! осуществляются с виртуальной валютой Roblox - так называемые Robux, также в игре присутствует собственная валюта - Bucks. Заботясь о питомце, вы, помимо развлечения, сможете заработать баксы, просто покормите его, уложите спать или почитайте сказку, в общем, много всего интересного.\r\n\r\nТеперь фанаты игры «Роблокс» «Adopt Me!» могут украсить свой игровой курсор любимым питомцем!','Развлекайся с милыми питомцами из Адопт Ми в нашей коллекции курсоров','601c06c1b4732.png','2021-02-04 17:37:53','2022-10-26 03:43:21'),(55,'Генри Стикмин','Henry Stickmin','Henry Stickmin','henry-stickmin',0,0,'Генри Стикмен - главный персонаж серии игр. Стикмин, ранее безымянный, начинал свой путь, как незначительный воришка, с желанием быстро заработать легких денег. Однако после побега из тюрьмы Уэст-Меса в его жизни происходит много перемен, и он становится известным приступником после кражи тунисского Алмаза. У Генри есть выбор - стать успешным правительственным агентом, охотником за головами, лидером преступной организации, киборгом, либо продолжать преступный путь в одиночку. Игра радует любителей жанра множеством приключений и загадок, а вас ждет наша новая коллеция курсоров Генри Стикмен с ее забавными персонажами, среди них курсор Генри Стикмин, курсор Чарльз Кэлвин, курсор Реджинальд Копперботтом, курсор Правая Рука, курсор Элли Роуз и другие!','Планируйте удачный побег от скуки с коллекцией курсоров Генри Стикмен','603a6cd4b299c.png','2021-02-27 19:01:24','2022-10-26 03:43:21'),(56,'Hollow Knight','Hollow Knight','Hollow Knight','hollow-knight',0,0,'После успешного финансирования на Kickstarter, в 2017 году студия Team Cherry выпустила мультиплатформенную ПК игру Hollow Knight. Это история безымянного рыцаря и его открытиях в королевстве насекомых Hallownest. Игра по праву была признана одной из лучших в жанре метроидвания.\r\n\r\nГеймплей игры Hollow Knight основан на исследовании мира игры. Преодоление препятствий, разгадывание головоломок и поиск секретов, а также сражения с врагами. У игрока имеется уникальный набор улучшений и уловок для исследования мира и сражения в боях. Двигаясь от зоны к зоне, игрок побеждает боссов и получает необходимые улучшения для продвижения дальше. В результате чего, игрокам приходится посещать уже пройденные зоны для поиска секретов и прохождения по сюжету. И это также увлекательно, потому что зоны меняются каждый раз, принося новые сюрпризы и впечатления. Игру можно проходить по-разному, ведь между зонами есть несколько разных путей. Проходя по сюжету вы открываете карту зоны, но сначала карту необходимо раздобыть.\r\n\r\nГлавное оружие героя - гвоздь, чем-то похожий на меч, оружие можно улучшать у кузнеца, а также осваивать разные навыки владения оружием, что расширяет разнообразие атак. Атакуя врагов вы накапливаете специальный ресурс, который в дальнейшем можно использовать для улучшений или лечения.\r\nИграйте в Hollow Knight с удовольствием и не забудьте установить курсор мыши с вашим любимым персонажем. В нашей коллекции есть курсор Мистер Гриб, курсор Квиррел, курсор Игла Шершня, курсор Старый Коготь, курсор Мила и другие курсоры из Hollow Knight.','Попробуй не заблудиться в королевстве насекомых используя коллекцию курсоров Hollow Knight','603fc63b196ab.png','2021-03-03 20:24:11','2022-10-26 03:43:21'),(57,'Лего','Lego','Lego','lego',0,0,'Компания LEGO Group основана в далеком 1932 году и тогда она насчитывала всего 7 человек. Перед сотрудниками Lego стояла цель создать игрушки, развивающие творческие способности ребёнка, воображение и изобретательность. Удивительный факт, с момента своего появления в 1949 году, элементы LEGO во всех своих вариантах остаются совместимы друг с другом. Все элементы, созданные позже, по-прежнему совместимы с элементами, которые выпускаются сейчас, несмотря на изменения в дизайне и форме за все эти годы.\r\n\r\nКирпичик LEGO — это основа, представляющая собой полый пластмассовый блок, соединяющийся с другими такими же кирпичиками. Но в наборах Lego также существуют и другие детали, колеса, фигурки, платформы и даже электронные схемы с датчиками и электродвигателями. Вы можете собирать модели автомобилей, самолётов, поездов, кораблей, зданий, роботов. LEGO придерживается идеи модульности, наглядно демонстрирующую детям то, как можно решать те или иные задачи, развивать фантазию, мелкую моторику рук и навыки сборки. Детали конструкторов LEGO производятся с потрясающей точностью и идеально подходят друг к другу, это потрясающая точность 10 микрон.\r\n\r\nС недавних пор создано много популярных 3Д-анимационных историй Lego, где персонажи из наборов оживают и становятся участниками невероятных приключений. Если вы хотите иметь крутой курсор, в нашей коллекции курсоров Lego вы найдете многих персонажей из тв-серий Lego и анимационных фильмов. Курсор Lego Ниндзяго, курсор Lego Бэтмен, Курсор Lego Ниндзяго, Lego Wyldstyle курсор и многие другие.','Построй браузер своей мечты с коллекцией курсоров Lego','603fee803a3c3.png','2021-03-03 23:16:00','2022-10-26 03:43:21'),(58,'Говорящий Том и друзья','Talking Tom and Friends','Hablando de Tom y amigos','talking_tom',0,0,'Сериал рассказывает о повседневной жизни Говорящего Тома и его друзей. Том и его занудный деловой партнер Бен постоянно разрабатывают мобильные приложения и другие изобретения, чтобы достичь славы и богатства и попытаться показать себя миру, но это всегда приводит к обратным результатам. Подруга Тома, Анджела, пытается быть певчей звездой, независимо от того, что она делает, чтобы достичь этого. Сосед Тома, Джинджер очень часто заглядывает сюда, чтобы пошалить с озорством в рукаве. Глупый лучший друг и сосед по комнате Хэнк-домосед, ОЧЕНЬ много смотрит телевизор. А бывшая диссидентская поп-звезда Бекка Спарклз стала новой соседкой Анджелы по комнате и, похоже, влюбилась в Хэнка. Тем не менее, невзирая на неприятности всех форм и размеров, будь то злой Гендиректор, таинственный новый сосед Тома или просто несчастный случай в новом творении Бена, банда будет веселиться, несмотря ни на что, и всегда помнить одну вещь, которая держит их вместе: дружба никогда не заканчивается, также как и не заканчивается наша любовь к героям сериала, поэтому теперь вы можете установить себе курсор Говорящий том или курсор Бен, а может курсор Анджела, курсор Оливер!','Давай поговорим о твоем любимом герое в коллекции курсоров Говорящий том','6086bea85e176.png','2021-04-26 16:22:48','2022-10-26 03:43:21'),(59,'Леди Баг и Супер-Кот','Miraculous: Tales of Ladybug & Cat Noir','Miraculous: Tales of Ladybug & Cat Noir','miraculous',0,0,'Miraculous: Tales of Ladybug и Cat Noir, более известные как Miraculous Ladybug и Cat Noir, - это приключения супергероев из мультфильма о двух одноклассниках, которые под масками играют роль защитников Парижа от злодея, который в каждой серии придумывает новый способ навредить городу. Miraculous сделан во Франции с использованием компьютерной графики и анимации. Miraculous это не только мультсериал, но и коллекция комиксов, выпущенных по всему миру. Сериал очень любим юной аудиторией.\r\n\r\nДействие происходит в Париже, где Маринетт и Адриан - ученики старших классов в современной школе. Им выпала роль стать избранными в борьме со злом, спасая их родной город. Их цель уберечь оюдей от акумов. Эти маленькие существа в виде бабочек, способны вселиться в человека и превратить его в злодея.\r\n\r\nМаринетт может превращаться в Божью коровку, а Адриан - в Кота Нуара, но что удивительно, работая в паре, они не узнают друг друга под масками супергероев.\r\n\r\nСпешите на помощь Коту Нуару и Божьей коровке спасти Париж с помощью наших курсоров, на которых изображены ваши любимые персонажи. Какой персонаж для курсора выберете вы? Будет ли это курсор Miraculous Ladybug или, может быть, очаровательная маленькая Божья коровка Тикки или курсор Cat Noir? А может быть, Queen Bee с курсорами Rena Rouge? Выбор за вами!','Вступай в ряды супергероев вместе с коллекцией курсоров Леди Баг и Супер-Кот','6136079f68213.png','2021-09-06 12:20:47','2022-10-26 03:43:21'),(60,'BTS','BTS','BTS','bts',0,0,'BTS - мужская группа из семи участников компании BigHit Music. Они дебютировали 13 июня 2013 года с синглом \"No More Dream\". В Японии их дебют состоялся 24 декабря 2014 года с студийным альбомом Wake Up.\r\n\r\nНазвание группы, означает корейское выражение Bangtan Sonyeondan, что означает \"пуленепробиваемые бойскауты\". По словам Джей Хоупа, название означает желание группы блокировать стереотипы, критику и ожидания, которые нацелены на подростков как пули.\r\n\r\nКоллекция курсоров посвященная группе включает в себя всех участников коллектива, здесь Ким Нам Джун курсор (он же RM), Ким СокДжин курсор (Джин), Мин Юнги курсор (Шуга), Чон Хо Сок курсор (Джей-Хоуп), Пак Чи Мин курсор (Чимин), Ким Тэ Хён курсор (Ви) и Чон Чонгук курсор (Чонгук).','Встречайте своих кумиров с курсорами БТС','630637d0ab476.png','2022-08-24 14:38:08','2022-10-26 03:43:21'),(61,'Клинок рассекающий демонов аниме','Demon Slayer anime','Asesino de demonios animado','demon_slayer_anime',0,0,'Действие происходит в эпоху Тайсё. Ещё с древних времён ходят слухи о том, что в лесу обитают человекоподобные демоны, которые питаются людьми и ходят по ночам, ища новую жертву. Но... это же просто легенда, ведь так?..\r\n\r\nТандзиро Камадо — старший сын в семье, потерявший своего отца и взявший на себя заботу о своих родных. Однажды он уходит в соседний город, чтобы продать древесный уголь. Вернувшись утром, парень обнаруживает перед собой страшную картину: вся родня была зверски убита, а единственной выжившей является Нэдзуко — обращённая в демона, но пока не потерявшая всю человечность младшая сестра.\r\n\r\nС этого момента для Тандзиро и Нэдзуко начинается долгое и опасное путешествие, в котором мальчик намерен разыскать убийцу и узнать способ исцеления для своей сестры. Но в состоянии ли дети преодолеть все трудности и вернуться домой? Вы уже знаете ответ, а если нет - скорее устанавливайте курсоры Истребитель Демонов, с персонажами одной из самых популярных манги.','Курсоры Клинок рассекающий демонов - для настоящих ночных охотников','63063b59e929c.png','2022-08-24 14:53:13','2022-10-26 03:43:21'),(62,'Наруто аниме','Naruto anime','Naruto animado','naruto_anime',0,0,'В день рождения Наруто Узумаки на деревню под названием Коноха напал легендарный демон, Девятихвостый лис. Четвёртый Хокагэ ценой своей жизни спас деревню, запечатав демона в новорождённом Наруто, неосознанно обрекая его на жизнь в ненависти односельчан.\r\nНесмотря на недостаток таланта во многих областях ниндзюцу, неусидчивость и задиристость, у Наруто есть мечта — стать Хокагэ, сильнейшим ниндзя в деревне. Желая признания, которого не получал, он упорно работает и тренируется вместе со своими напарниками, Саскэ Учихой и Сакурой Харуно, а также со своим наставником Какаши Хатакэ. Ему и его напарникам придётся пройти через многое по пути к своим заветным мечтам: сражения, любовь, дружба, предательство, жажда силы. Коллекция аниме курсоров Наруто поможет тебе пройти свой собственный путь!','Пройди свой путь ниндзя с курсорами Наруто аниме','63063cfea062e.png','2022-08-24 15:00:14','2022-10-26 03:43:21'),(63,'Роблокс Бед Варс','Roblox Bed Wars','Roblox Bed Wars','roblox_bed_wars',0,0,'Бед варс – это оригинальный режим, появившийся впервые в Майнкрафте. Задача игроков была в том, чтобы пользователь защищал свою базу и кровать. \r\n\r\nRoblox каждый день приносит больше интересных игр, и BedWars не исключение. И дело в том, что если вы любите постельные войны и защищаете себя в своей комнате, это название для вас, потому что оно переносит вас в детство, хотя на этот раз в цифровом формате.\r\n\r\nВсе, что вам нужно сделать, это вместе с напарником защищать свою кровать от нападающих. Вы входите в лобби, выбираете, с кем играть, и вуаля, это просто вопрос защиты.\r\n\r\nКонечно, когда дело доходит до защиты, у вас будут некоторые проблемы, и есть определенные ресурсы, предметы и предметы, которые помогут вам победить. Например, эксклюзивные скины, которые вы найдете в коллекции курсоров Бед варс.','Защити свою кровать с курсорами Роблокс Бед Варс','630647c0cecd4.png','2022-08-24 15:46:08','2022-10-26 03:43:21'),(64,'Очень странные дела 4','Stranger Things 4','Cosas más extrañas 4','stranger_things',0,0,'После финала третьего сезона прошло чуть больше полугода. Джойс, Уилл, Одиннадцать и Джонатан переехали в Калифорнию, где девушку травят в школе. Остальные начинают бороться с новым монстром из параллельного мира, который появился в Хокинсе. Его назвали Векна в честь персонажа настольной игры Dungeons & Dragons. Он влияет на подростков психологически, потом мысленно забирается в голову и убивает. Параллельно с этим Джойс и Мюррей узнают, что Джим Гоппер жив и отправляются за ним в советскую тюрьму на Камчатке. А Одиннадцать предстоит вернуть и увеличить силы, но также узнать свою важную роль в создании того же монстра в Гокинсе.\r\n\r\nСценаристы не стали менять тактику сюжета, которая им понравилась последние несколько сезонов. В четвертом сезоне они поделили крупную компанию главных героев на группы, придумали для них сложные задачи, а в конце построили их истории вместе в удивительном финале. Предлагаем подробно разобраться во всех этих приключениях с помощью коллекции курсоров Очень странные дела.','Что будет дальше? - курсоры Очень странные дела 4','63064ddfac360.png','2022-08-24 16:12:15','2022-10-26 03:43:21'),(65,'Игра в кальмара','Squid Game','Juego de calamar','squid_game',0,0,'Сериал вращается вокруг конкурса, в котором 456 игроков, каждый из которых имеет большие финансовые долги, рискуют своими жизнями, чтобы сыграть в серию смертельных детских игр, чтобы получить шанс выиграть миллиардный приз. Внутри вас ждет заманчивый приз со смертельно высокими ставками. Название серии взято из одноименной корейской детской игры. Хван задумал эту идею, основанную на его собственной экономической борьбе в раннем возрасте, а также на классовом неравенстве в Южной Корее и капитализме.','Выбирайте правильного игрока, когда идете ва-банк','634066a6a36e6.png','2022-10-07 17:49:26','2022-10-26 03:43:20'),(66,'Марвел','Marvel Comics','Marvel Comics','marvel_comics',0,0,'Marvel Comics — издательство комиксов, известное созданием известных супергероев, таких как Человек-паук, Железный человек, Капитан Америка, Халк, Тор, Мстители, Стражи Галактики, Люди Икс, Фантастическая четверка и Дэдпул. . Среди самых известных злодеев Marvel — Зеленый Гоблин, Красный Череп, Локи, Танос, Альтрон, Доктор Дум и Магнето. Marvel Comics и DC Comics совместно работали над несколькими кроссоверными проектами, а также стали соучредителями намеренно недолговечного издательства Amalgam Comics.','В каждом из нас живет супергерой - выбери своего','63406abddbf18.png','2022-10-07 18:06:53','2022-10-26 03:43:20'),(67,'Геншин Импакт','Genshin Impact','Genshin Impact','genshin_impact',0,0,'Genshin Impact — приключенческая игра с открытым миром. Это значит, что по ту сторону реки или горы вас ждет новый, восхитительный пейзаж, нужно только с умом использовать свою энергию. Если вам встретится странствующая фея или странный механизм, дерзайте и попытайтесь разгадать их тайну. А вот что они обещают - неприятности или приятную неожиданность - сможете узнать только вы! На огромном континенте Тейват вы побываете в семи королевствах, найдете компаньонов с различными навыками и сразитесь с могущественными врагами в поисках пропавшего любимого человека.','Станьте Повелителем Элементалей Семи Королевств','63406b710fa37.png','2022-10-07 18:09:53','2022-10-26 03:43:20'),(68,'Холодное сердце','Frozen','Frozen','frozen',0,0,'Когда сбывается древнее пророчество и королевство погружается в объятия зимы, трое бесстрашных героев — принцесса Анна, отважный Кристофф и его верный северный олень Свен — отправляются в горы, чтобы найти сестру Анны Эльзу, которая сможет снять леденящие чары с страна. По пути их ждет множество непростых сюрпризов и захватывающих приключений. Встреча с мистическими троллями, встреча с очаровательным снеговиком по имени Олаф, горные вершины круче Эвереста и много волшебства. Героям предстоит противостоять могучей стихии, чтобы спасти королевство и тех, кто им дорог.','Сломать лед легко с коллекцией курсоров Frozen','63406c1980b77.png','2022-10-07 18:12:41','2022-10-26 03:43:21'),(69,'Хало','HALO','HALO','halo',0,0,'Halo — фэнтезийная медиа-франшиза, созданная Bungie. На основе оригинальной трилогии шутеров от первого лица. Сюжет вращается вокруг событий, происходящих в жизни Мастера Чифа, одного из группы суперсолдат под кодовым названием «Спартанцы», и его спутницы, искусственного интеллекта Кортаны. Успех игр привел к распространению франшизы на другие средства массовой информации: вселенная Halo в настоящее время охватывает множество книг, графических романов, комиксов, короткометражных фильмов, мультфильмов и художественных фильмов.','Коснитесь курсора артефакта, возможно, вы избранный','63406ca770119.png','2022-10-07 18:15:03','2022-10-26 03:43:20'),(70,'L.O.L. Сюрприз','L.O.L. Surprise','L.O.L. Surprise','lol_surprise',0,0,'Куклы ЛОЛ Сюрприз полюбились детям и покорили их сердца с первых минут. И это неудивительно, ведь в основе такого успеха лежит тайна, ожидание чуда, приятный сюрприз, который приводит в восторг не только малышей, но и их родителей. Секрет подарка открывается ребенку только после окончательной распаковки. В любом случае, куклы ЛОЛ – это привлекательный дизайн, интрига, большое количество удивительных и реалистичных аксессуаров и приятных мелочей, а также высочайшее качество изготовления и детализации игрушки.','Прикольные милашки для ценителей красивых сюрпризов','63406d667694f.png','2022-10-07 18:18:14','2022-10-26 03:43:20'),(71,'Гарри Поттер','Harry Potter','Harry Potter','harry_potter',0,0,'Гарри Джеймс Поттер — главный герой серии романов английской писательницы Дж. К. Роулинг. В свой одиннадцатый день рождения Гарри узнает, что он волшебник и что ему предназначено место в школе волшебства Хогвартс, где он будет практиковать магию под руководством директора школы Альбуса Дамблдора и других школьных профессоров. Гарри также обнаруживает, что он уже известен всему волшебному сообществу романа, и что его судьба связана с судьбой Волан-де-Морта, опасного темного мага.','Что ты будешь делать с волшебной палочкой из коллекции курсоров Гарри Поттера','63406df5e711a.png','2022-10-07 18:20:37','2022-10-26 03:43:20'),(72,'Куки Ран Кингдом','Cookie Run Kingdom','Cookie Run Kingdom','cookie_run_kingdom',0,0,'Добро пожаловать в Королевство Cookie в игре Cookie Run: Kingdom от Devsisters, очаровательной RPG-стратегии, действие которой происходит во вселенной Cookie Run. Теперь, когда GingerBrave сбежал из духовки злой ведьмы, пришло время собрать команду Cookies и отправиться на поиски восстановления павшего Королевства Cookie. Раскройте правду о падении Королевства и соберите отряд самых могущественных Печенек Королевства, чтобы победить темные силы, которые хотят помешать GingerBrave исполнить свое предназначение.','Маленькие воины прямо из печи','63406e98a8368.png','2022-10-07 18:23:20','2022-10-26 03:43:20');
